(13, 16, 13, '7', 'The magical age of Bollywood- 90’s', '<p>I still remember I was 4 years old since I started to listen to the songs. Back in those years (1994-1999) there was a magical gadget existed, an audio cassette. I found the gadgets very intrigued, as it was small in size and could embrace many songs in it. I used to just intrude these cassettes in tape-recorder and used to listen to them for hours. My favourite song back then was &ldquo;<em>ye kali kali aankhen</em>&rdquo; from the romantic-action thriller &ldquo;Baaziger&rdquo;. And of course, I was a big fan of Shah Rukh Khan. The way he used to act with all his serious, charm attributes, he simply imprinted himself as a good actor with good looks. I always used to adore him, and also tried to imitate him, like in his dialogue &ldquo;<em>kkk kirrann...&rdquo;</em> from his epic Thriller-Romantic &ldquo;Darr&rdquo;.</p>\r\n\r\n<p>Those sweet-sounding compositions also made a positive effect on the movies at that time. The 1990&rsquo;s Musical-Romance &ldquo;Aashiqui&rdquo;, all the songs that are in the films were originally supposed to be on the album, songs were already recorded by duo-composer Nadeem-Shravan. But when director producer Mr. Mahesh Bhatt listened to those songs, he was so stunned that he asked Gulshan Kumar to relinquish the album and make a movie for these songs. The Movie got released and rest is the history. Singers like Kumar Sanu had emerged from the movie &ldquo;Aashiqui&rdquo;. His unique melodious voice with little nasal touch in his voice made him a top singer at that time. His voice and tonal quality were alike the voice of legendary singer Kishore Kumar.</p>\r\n\r\n<p>This decade also gave us numerous superstars of Bollywood like Shah Rukh Khan, Ajay Devgan, Akshay Kumar, Saif Ali Khan, etc. All other movies in the 90&rsquo;s were the genre of family melodrama, romance and action-packed. Film director like Suraj Barjatya and Rajkumar Santoshi were specialized in family melodrama. Films like &ldquo;<em>Hum Aap Ke Hai Kaun</em>&rdquo;, &ldquo;<em>Hum Sath Sath Hai</em>&rdquo;, &ldquo;<em>Swarg</em>&rdquo;, and &ldquo;<em>Ghar ho to Aisa</em>&rdquo; got vivid popularity in the middle class as well as the rich class family audience. Those were the films that an entire family could watch together. If anyone wonders that who were the actors from 90&rsquo;s made us all go like LOL? Definitely, anyone can answer, that&rsquo;s &ldquo;Govinda&rdquo;. His hilarious face expression and quirky dialogue style literally made me laugh my lungs out. His all-time favourite movies like &ldquo;<em>Raja Babu</em>&rdquo;, &ldquo;<em>Hero No1</em>&rdquo;, &ldquo;<em>Aankhen</em>&rdquo;, &ldquo;<em>Dulhe Raja</em>&rdquo; still bring candid laughter on our face. Then there was Akshay Kumar who was known as an Action Hero, acted in some of the action films like &ldquo;<em>Khiladi Series</em>&rdquo;. On the other hand was Ajay Devgan, famous for his serious acting skills.</p>\r\n\r\n<p>Anybody can say anything, but I personally feel that 90&rsquo;s era was the golden blend of all genre of entertainment. It was probably the last best era of Bollywood. The era really made my childhood awesome.</p>\r\n', '5996c250f2539236.jpg', NULL, 'N', NULL, 1, 'Y', '2017-08-18 16:02:48', '2017-08-18 19:21:23'),
(14, 16, 14, '7', '2000- The cult changing era in Bollywood', '<p>&ldquo;Dekho 2000 Jamana Aa Gaya&rdquo; song from the movie &ldquo;Mela&rdquo; rang the bell on the door of 2000. I saw tremendous changes through the 90s to 2000s. Even though I was a huge fanatic of the movies and music in 90&rsquo;s, I feel that the movies in 2000 had a more developed and diverse kind of story line, directional style, music. Everything was like in the hand of trail blazers.&nbsp; Movies like &ldquo;Kaho Naa Pyar Hai&rdquo;, &ldquo;Lagaan&rdquo;, and &ldquo;Gadar&rdquo; plant the seeds of the bear fruit. A realistic storyline was the mainstream of the films in 2000.</p>\r\n\r\n<p>This era had really turned out to be a cult changing. There were films like &ldquo;Rehena Hai Tere Dil Main&rdquo;, &ldquo;Dil Chahata Hai&rdquo; changed the trend of Bollywood. All the flavours of human emotions were properly showcased in the movies like &ldquo;Black&rdquo;, &ldquo;Monsoon Wedding&rdquo;, &ldquo;Kal Ho Na Ho&rdquo; etc. All the movies in this era had their own unique identity. &nbsp;The image of the hero from this era has changed from sweet and soft spoken person to a masculine rigid personality; they started to exercise more at a gym to build their hot steamy body, to acquire abs. Comedy genre also touched a zenith milestone when Priyadarshan directed comedy-drama &ldquo;<em>Hera Pheri</em>&rdquo; released in 2000. Also, there were some inspirational movies like &ldquo;<em>Udaan</em>&rdquo;, &ldquo;<em>Rocket Singh: Salesman of the Year</em>&rdquo;, &ldquo;<em>3 Idiots</em>&rdquo; brought different colours in the life of Indian cinema. &ldquo;Rang De Basanti&rdquo;, &ldquo;Swades&rdquo;, &ldquo;Chak De India&rdquo;, &ldquo;Slumdog Millionaire&rdquo; were the films that make us all Indian proud. When it comes to realistic core acting there are only a few names that echoed in my ears, few of them &ldquo;Nawazuddin Siddiqui&rdquo; and &ldquo;Irrfan Khan&rdquo;. Despite carrying very ordinary looks, Nawaz was able to gain success in Bollywood only on the guts of acting, his movies like &ldquo;Gangs of Wasseypur&rdquo;, &ldquo;Raman Raghav 2.0&rdquo;, &ldquo;Black Friday&rdquo; succeeded at the box office. Irrfan Khan was also made films like &ldquo;<em>Lunchbox</em>&rdquo;, &ldquo;<em>Madar</em>i&rdquo; which proved him one of the finest and natural actors in the industry.</p>\r\n\r\n<p>The music in this era had a little different taste than the 90&rsquo;s. Indi Pop songs trend which was introduced in late 90&rsquo;s came forward openly in early 2000. Singers like Sonu Nigam, Aalisha Chinnoy, Shaan, Falguni Pathak, Euphoria, Aaryans, and Bombay Vikings created most fresh fruit like pop songs and albums in early 2000. The way those songs were shot was also in &ldquo;fantasy comes true&rdquo; fashion. In most of the songs the story used to revolve around the Hero and Heroine, and how they express their love in most sweet and romantic way. Songs also had the same flavour of sweetness and love. But gradually this sweetness and softness of compositions converted into bitterness in the movies past 2009-2010. Adopted from western country&rsquo;s Hip hop and Rap style, was introduced by Yo Yo Honey Singh, Badshah in India past 2010. The quality level of lyrics also decreased in those songs. But today&rsquo;s generation like this music most. They have nothing to do with the music, all they like high beat music with fast rapping style. But I really thank some saviors singers of this generation like Arijit Singh, Rahat Fateh Ali Khan, Arman Malik, they still believe in melodious and Sufi composition, which is decent to listen and lyrics of the songs also not the worst thing in the industry.</p>\r\n\r\n<p>This era may not have an ever greenness as 90&rsquo;s or before, but this era had given us different shades of stories, acting skill, and music. &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '5996c811a591e259.jpg', NULL, 'N', NULL, 1, 'Y', '2017-08-18 16:27:21', '2017-08-18 19:21:20'),
(15, 16, 15, '7', 'Dasvidaniya (2008) Review', '<p><strong>Cast:</strong> <a href=\"https://en.wikipedia.org/wiki/Vinay_Pathak\">Vinay Pathak</a>, <a href=\"https://en.wikipedia.org/wiki/Neha_Dhupia\">Neha Dhupia</a>, <a href=\"https://en.wikipedia.org/wiki/Rajat_Kapoor\">Rajat Kapoor</a>,<a href=\"https://en.wikipedia.org/wiki/Ranvir_Shorey\">Ranvir Shorey</a>, <a href=\"https://www.google.co.in/search?sa=X&amp;biw=1024&amp;bih=662&amp;q=Sarita+Joshi&amp;stick=H4sIAAAAAAAAAOPgE-LSz9U3MC7MMzRKUQKzTdIMjSxMtCSzk630C1LzC3JSgVRRcX6eVUFiUWpeSTEAC1Jd4jUAAAA&amp;ved=0ahUKEwjgmP38ydvVAhWKPI8KHUCDAY8QmxMItAEoATAW\">Sarita Joshi</a>, <a href=\"https://www.google.co.in/search?sa=X&amp;biw=1024&amp;bih=662&amp;q=Saurabh+Shukla&amp;stick=H4sIAAAAAAAAAOPgE-LSz9U3yKrMMysuUAKzjcyyyywytCSyk630C1LzC3JSgVRRcX6eVXFBfmlxKgBDHqQcNAAAAA&amp;ved=0ahUKEwjvmOKRytvVAhUIMI8KHfaoDZYQmxMIlAEoATAT\">Saurabh Shukla</a>, <a href=\"https://en.wikipedia.org/wiki/Gaurav_Gera\">Gaurav Gera</a>.</p>\r\n\r\n<p><strong>Director: </strong>Shashant Shah.</p>\r\n\r\n<p><strong>Synopsis: </strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The story is all about the 37 years old mid-aged Amar Kaul (Vinay Pathak), an account manager who works at Pharmaceuticals Company. He lives with his widowed mother. Being unmarried and not having any sense of living, he becomes the man of nondescript and mundane nature. He likes to make a to-do list of his daily work. His mean boss Dasgupta (Saurabh Shukla) never misses fire to insult him. One day Amar discovers from his doctor that he is suffering from an atrocious stomach cancer and has only 3 months to live. Obviously, he feels blue. But knowing that he is going to say goodbye to the world soon, he makes a list of 10 things to do before he dies. And embark his quest towards the accomplishment of his dream wishes. While doing this he finds true joy of a life. And by the time of his death, he has achieved everything that was on his list and left those wishes for his loved and dear ones.</p>\r\n\r\n<p><strong>Review:</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>When I saw the name of Shashant Shah as a director of the film, I didn&rsquo;t know who he is. But the film itself gave me an identity of him. He brought different colours of life in a very realistic way in this movie. All the little pieces of human&rsquo;s nature gently portrayed by protagonist Vinay Pathak. The other actors who played a side role in this movie also helped significantly Vinay to lavish the film. Versatile Actor Rajat Kapoor played a role of Rajiv Jhulka a dear infancy friend of Amar Kaul, acted superbly as a Doctor, who lives abroad. The genuine care that he expresses about Amar&rsquo;s health seems pretty real. Saurabh Shukla who played Dasgupta a mean boss of Amar also gave his natural efforts to made Amar quit his job. All other characters like Neha Banot (Neha Dhupia) who is puppy love of Amar, Maa (Sarita Joshi) a careful but little wacky mother who is always into the TV serials, Vivek Kaul (Gaurav Gera) a younger brother who got exclude from the house by his mother because he married to the girl from different cast, all the actors supported exquisitely to the team. The directional style is little unorthodox but positively beaming. The story writer Arshad Syed has crafted a story in every genetic way. The story gives us an apparent idea of middle-class family and a family person who lives in Mumbai. The main character Amar Kaul justified the core of the story. The characteristics of Amar like self-centered, reticent etc. actually symbolize a person who is self-involved. The film doesn&rsquo;t seem slow or off the track anywhere. When Amar finally realizes the huge quandary in his life i.e. Stomach Cancer at 3rd stage, the scene really stuck audience emotionally. The music composed by Kailash Kher is also has a decent touch. The song &ldquo;O Maa Meri Maa Pyaari Maa - Mammaa&rdquo; enlightens and freshens up the mood.</p>\r\n\r\n<p>Although this movie wasn&rsquo;t a big hit at box office, many critics have appreciated the movie and the especially work of Vinay Pathak.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n', '5996c8f74d08d992.jpg', NULL, 'N', NULL, 1, 'Y', '2017-08-18 16:31:11', '2017-08-18 19:21:17'),
(16, 16, 16, '7', 'Homearts FB Blog', '<p>Let interior create the story for your house.</p>\r\n\r\n<p>You buy the house to see yourself living in that house, but that just for your livelihood. But what about the fairy-tale about your house that you must have imagined before you buy your house? Everybody has their fairy-tale about their houses, and we are the initiator of your fairy-tale of the house. And we make sure that your fairy-tale has a perfect climax ending.</p>\r\n\r\n<p>&nbsp;Interior gives your house vivid kinds of angles that may change your angle to look at your house in a very pleasant way. Colours can be a vital ravel between the rooms in your house. We design your rooms in such way that colours can shade your emotions with your house. A Blend of colours is the mainstream of the interior. Perfectly arranged things in your house can give your house a neatly look, but that just not enough. Only the neat look can be boring, neatness always compliments beautifulness. Glitter your house with the little beauties like hanging lamps that enlighten your room aura, lovely flyers that portray your little notes in a most endeavor-less way, splendid cushions that can create most candid motion of yours, whilst you are lying on the bed. There are so many other ways to decorate your house with our joker card, all you need to do is just to contact us and express your unique idea for fairy-tale of yours, and we are ready to create a story with our own characters. And just remember one thing that &ldquo;Looks can be deceptive&rdquo;, but we are not.</p>\r\n\r\n<p>On that note, we would like to sign off for now.</p>\r\n\r\n<p>Regards,<br />\r\nHomeart Concepts</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '5996c9b80485b326.jpg', NULL, 'N', NULL, 1, 'Y', '2017-08-18 16:34:24', '2017-08-18 19:21:13'),
(17, 16, 17, '7', 'A Lure of youth towards the vocational courses.', '<p>&nbsp;Education in these days has become the most significant facet in India. There are much more courses existed than the states in India. We see this age as a most educated age of Indian history. Each and every advance educational programme runs by different institutions of an India. Every year numerous numbers of Grads are passed out from different colleges. But then what they do after?</p>\r\n\r\n<p>According to the article of &ldquo;The Times of India&rdquo; dated 14th August 2017, MBA graduates in India are facing arduous problems to get a job. The survey says that one in every two of MBAs in India fails to get a job. Stats also show that the class of 2016 saw 75,658 students get jobs on campus. But there is no clarity on what happened to the equally large number of those who signed up for the courses in 3080 colleges spread across India.</p>\r\n\r\n<p>Let&rsquo;s consider an MBA course for consideration. The MBA programme is considered to be a fanciest and lucrative course in India, those who want to be the successful businessman or someone who really wants to imprint their crafts in management, usually choose an MBA as a pavement. There are so many big B-Schools like IIM which conduct an MBA course. But this approach can be deceptive for some people. Many enrolled for an MBA just because they see it as a money making machine, or someone does it because their parents told them, or many joined MBA to get a White Collar respect. But are these the real reasons for working? Of course not, unless and until you are passionate about it.</p>\r\n\r\n<p>But there are some youngsters or even middle-aged persons, who are stuck in the wrong place from the yore time. Their passion might be something else and they are doing something else. Passion is what they have missed out on. These folks may know what they actually wanted to do in their life but never got a chance to fulfil their passionate dream or may never show courage to justify their passion. These people surely are regretting their decision somewhere. For instance, a guy who works at IT company from past 2 years, and may now realise that singing is the sea, which he always sees. Sometimes these want to be out of box thinkers might be reluctant to jump out the box for the obvious reasons.</p>\r\n\r\n<p>But this is where Cast India comes into the picture. Cast India is a platform for the aspiring artist, where all kinds of artists are welcome gladly. Cast India will help the astonishing talented aspiring artist who really wants to build their milestone in the creative field. Cast India will help all the ambitious applicants to cope up with the recruiter in the field of an art. Cast India offers its service to all artists including actor, model, singer, cinematographer, photographer, editor, writer etc. All you need to do is, just visit our website <a href=\"http://www.castindia.in\">www.castindia.in</a> and register yourself as a recruiter or applicant.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '5996ca342e081194.jpg', NULL, 'N', NULL, 1, 'Y', '2017-08-18 16:36:28', '2017-08-18 19:21:10'),
(18, 16, 18, '7', 'Black and White Era', '<p>Whenever I heard the word &ldquo;Black and White Movies&rdquo;, my subconscious mind shows me the pictures of movies in the decade of 50&rsquo;s. Even though I did not get an honour to feel the real existence of black and white movies, I still could watch all the movies and songs that had been recorded and shoot in black and white colour technology, thanks to the advanced technology that has arisen in these days. But you can only watch those movies now on the internet, but you cannot take the full joy of it as you are habitat to the colours movies of this modern and advanced age. Some people might have found these movies boring and outdated. But true cine lover can tell you the real magic of Black era.</p>\r\n\r\n<p>Black and white era was known as a Golden Era. The reason behind this was pretty obvious. The film styles back then were simple as a dimple, and clean as a slate. Storylines had its own tender touch of Indian society back then. No violence, no action, not steamy romance as compared to today&rsquo;s films. But despite all of the things movies from the golden era still feel like a real gold in our hand. Veteran actors like &ldquo;The showman Raj Kapoor&rdquo;,&rdquo; Nargis Dutta&rdquo;,&rdquo;Dilip Kumar&rdquo; and Dev Anand actually invented the phrase &ldquo;Sweet but simple&rdquo; by their innocent acting. As India was recently got a freedom, movies were also depicted the situation in India. Black and white mean only two colours (and no other colours) that were used to create a movie, but we could still see the different colours of a real acting acted by the actors and actresses of that time. It was the prime time of Bollywood.</p>\r\n', '5996cb01548db454.jpg', NULL, 'N', NULL, 1, 'Y', '2017-08-18 16:39:53', '2017-08-18 19:21:06'),
(19, 17, 19, '1', 'Art', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;MUSING THE VIEWED</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Friday 11, August 2017, an amazing event presented by Art2 day art gallery with the greatest artists, Arti kirloskar, Bharati Pittre and Snehal Chordia Goyal to tell about their experiences and many different art forms which they encountered in Documenta 14 in Germany which happens in every 5 years &amp; also known as &ldquo; museum for 100 days&rdquo;. There were many different artists with their creativity and amazing art forms.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; One of them was Martha Minujin&rsquo;s, painter, sculpture artist and performing artist created&rdquo; the Parthenon of Books&rdquo;. The Parthenon is made out of forbidden books and the books of authoress who have been persecuted, it was built in Athen&rsquo;s the reason it was created because under Nazi rule in Germany there were 30 thousand books which were burned thinking that the books were ungerman spirit. The Parthenon is still setting up artist has requested people to donate all the forbidden books.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; From Montegomery, West Virginia Annie Sprinkie and Beth Stephens who is a porn star, depicted their past life how it was as a sex worker and what all they went through in their life journey, in a form of miniature paintings and poems which were really sensitive. These two girls initiated 7 years project for public quarrying rituals, where they married to the Earth, Sun, Moon, Trees, Rivers and lakes to collaborate with nature love and create mutual &amp; sustainable relationship. The thought behind this art is very interesting as we see in India artist from all these backgrounds are not accepted easily.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Another, fascinating art was created by Architecture Hiwa K with the collaboration of product designing students of Kassel. These were vitrified clay pipes, the idea behind of creating this was to depict the poverty and what happens when a Pearson has no longer his own home or shelter to stay, which we see something similar in India, when a Pearson is homeless or there is no shelter they live in these kinds of pipes. These vitrified pipes were meant to be a kind of hotel where there were bed rooms, kitchens, washrooms and also a library where people could come eat, read, cook and stay.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; There were many more artists with different art forms and new ideas which we could never think off or see something like this before. This shows how things have changed from the past and how art and different art forms have evolved. These artists and their art forms have made us think more than beyond.&nbsp;</p>\r\n', '599a992c67d0f935.jpg', NULL, 'Y', NULL, 1, 'N', '2017-08-21 13:52:18', '2017-08-21 15:56:38');
