(4, 12, 'Section 1.10.33 of \"de Finibus Bonorum et Malorum\", written by Cicero in 45 BC', NULL, '<h3>1914 translation by H. Rackham</h3>\r\n\r\n<p>&quot;But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?&quot;</p>\r\n\r\n<h3>Section 1.10.33 of &quot;de Finibus Bonorum et Malorum&quot;, written by Cicero in 45 BC</h3>\r\n\r\n<p>&quot;At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae. Itaque earum rerum hic tenetur a sapiente delectus, ut aut reiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat.&quot;</p>\r\n\r\n<h3>1914 translation by H. Rackham</h3>\r\n\r\n<p>&quot;On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.&quot;</p>\r\n', '598f28f9228f3697.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-08-12 21:42:41', '2017-08-17 00:40:18'),
(5, 12, 'The standard Lorem Ipsum passage, used since the 1500s', '1,2', '<p>&quot;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.&quot;</p>\r\n\r\n<h3>Section 1.10.32 of &quot;de Finibus Bonorum et Malorum&quot;, written by Cicero in 45 BC</h3>\r\n\r\n<p>&quot;Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?&quot;</p>\r\n', '5994985564ff3998.jpg', NULL, 'Y', NULL, 1, 'Y', '2017-08-13 14:35:27', '2017-08-21 14:35:33'),
(6, 14, 'The magical age of Bollywood- 90’s', '1', '<p><strong>I still remember I was 4 years old since I started to listen to the songs. Back in those years (1994-1999) there was a magical gadget existed, an audio cassette. I found the gadgets very intrigued, as it was small in size and could embrace many songs in it. I used to just intrude these cassettes in tape-recorder and used to listen to them for hours. My favourite song back then was &ldquo;ye kali kali aankhen&rdquo; from the romantic-action thriller &ldquo;Baaziger&rdquo;. And of course, I was a big fan of Shah Rukh Khan. The way he used to act with all his serious, charm attributes, he simply imprinted himself as a good actor with good looks. I always used to adore him, and also tried to imitate him, like in his dialogue &ldquo;kkk kirrann...&rdquo; from his epic Thriller-Romantic &ldquo;Darr&rdquo;.</strong></p>\r\n\r\n<p><strong>Those sweet-sounding compositions also made a positive effect on the movies at that time. The 1990&rsquo;s Musical-Romance &ldquo;Aashiqui&rdquo;, all the songs that are in the films were originally supposed to be on the album, songs were already recorded by duo-composer Nadeem-Shravan. But when director producer Mr. Mahesh Bhatt listened to those songs, he was so stunned that he asked Gulshan Kumar to relinquish the album and make a movie for these songs. The Movie got released and rest is the history. Singers like Kumar Sanu had emerged from the movie &ldquo;Aashiqui&rdquo;. His unique melodious voice with little nasal touch in his voice made him a top singer at that time. His voice and tonal quality were alike the voice of legendary singer Kishore Kumar.</strong></p>\r\n\r\n<p><strong>This decade also gave us numerous superstars of Bollywood like Shah Rukh Khan, Ajay Devgan, Akshay Kumar, Saif Ali Khan, etc. All other movies in the 90&rsquo;s were the genre of family melodrama, romance and action-packed. Film director like Suraj Barjatya and Rajkumar Santoshi were specialists in family melodrama. Films like &ldquo;Hum Aap Ke Hai Kaun&rdquo;, &ldquo;Hum Sath Sath Hai&rdquo;, &ldquo;Swarg&rdquo;, and &ldquo;Ghar ho to Aisa&rdquo; got vivid popularity in the middle class as well as the rich class family audience. Those were the films that an entire family could watch together. If anyone wonders that who were the actors from 90&rsquo;s made us all go like LOL? Definitely anyone can answer, that&rsquo;s &ldquo;Govinda&rdquo;. His hilarious face expression and quirky dialogue style literally made me laugh my lungs out. His all-time favourite movies like &ldquo;Raja Babu&rdquo;, &ldquo;Hero No1&rdquo;, &ldquo;Aankhen&rdquo;, &ldquo;Dulhe Raja&rdquo; still bring candid laughter on our face. Then there was Akshay Kumar who was known as an Action Hero, acted in some of the action films like &ldquo;Khiladi Series&rdquo;. On the other hand was Ajay Devgan, famous for his serious acting skills.</strong></p>\r\n\r\n<p><strong>Anybody can say anything, but I personally feel that 90&rsquo;s era was the golden blend of all genre of entertainment. It was probably the last best era of Bollywood. The era really made my childhood awesome.</strong></p>\r\n', '599173242cf24225.jpg', NULL, 'N', NULL, NULL, 'N', '2017-08-14 15:23:40', NULL),
