(13, 16, 'The magical age of Bollywood- 90’s', '7', '<p>I still remember I was 4 years old since I started to listen to the songs. Back in those years (1994-1999) there was a magical gadget existed, an audio cassette. I found the gadgets very intrigued, as it was small in size and could embrace many songs in it. I used to just intrude these cassettes in tape-recorder and used to listen to them for hours. My favourite song back then was &ldquo;<em>ye kali kali aankhen</em>&rdquo; from the romantic-action thriller &ldquo;Baaziger&rdquo;. And of course, I was a big fan of Shah Rukh Khan. The way he used to act with all his serious, charm attributes, he simply imprinted himself as a good actor with good looks. I always used to adore him, and also tried to imitate him, like in his dialogue &ldquo;<em>kkk kirrann...&rdquo;</em> from his epic Thriller-Romantic &ldquo;Darr&rdquo;.</p>\r\n\r\n<p>Those sweet-sounding compositions also made a positive effect on the movies at that time. The 1990&rsquo;s Musical-Romance &ldquo;Aashiqui&rdquo;, all the songs that are in the films were originally supposed to be on the album, songs were already recorded by duo-composer Nadeem-Shravan. But when director producer Mr. Mahesh Bhatt listened to those songs, he was so stunned that he asked Gulshan Kumar to relinquish the album and make a movie for these songs. The Movie got released and rest is the history. Singers like Kumar Sanu had emerged from the movie &ldquo;Aashiqui&rdquo;. His unique melodious voice with little nasal touch in his voice made him a top singer at that time. His voice and tonal quality were alike the voice of legendary singer Kishore Kumar.</p>\r\n\r\n<p>This decade also gave us numerous superstars of Bollywood like Shah Rukh Khan, Ajay Devgan, Akshay Kumar, Saif Ali Khan, etc. All other movies in the 90&rsquo;s were the genre of family melodrama, romance and action-packed. Film director like Suraj Barjatya and Rajkumar Santoshi were specialized in family melodrama. Films like &ldquo;<em>Hum Aap Ke Hai Kaun</em>&rdquo;, &ldquo;<em>Hum Sath Sath Hai</em>&rdquo;, &ldquo;<em>Swarg</em>&rdquo;, and &ldquo;<em>Ghar ho to Aisa</em>&rdquo; got vivid popularity in the middle class as well as the rich class family audience. Those were the films that an entire family could watch together. If anyone wonders that who were the actors from 90&rsquo;s made us all go like LOL? Definitely, anyone can answer, that&rsquo;s &ldquo;Govinda&rdquo;. His hilarious face expression and quirky dialogue style literally made me laugh my lungs out. His all-time favourite movies like &ldquo;<em>Raja Babu</em>&rdquo;, &ldquo;<em>Hero No1</em>&rdquo;, &ldquo;<em>Aankhen</em>&rdquo;, &ldquo;<em>Dulhe Raja</em>&rdquo; still bring candid laughter on our face. Then there was Akshay Kumar who was known as an Action Hero, acted in some of the action films like &ldquo;<em>Khiladi Series</em>&rdquo;. On the other hand was Ajay Devgan, famous for his serious acting skills.</p>\r\n\r\n<p>Anybody can say anything, but I personally feel that 90&rsquo;s era was the golden blend of all genre of entertainment. It was probably the last best era of Bollywood. The era really made my childhood awesome.</p>\r\n', '5996c250f2539236.jpg', NULL, 'N', NULL, NULL, 'N', '2017-08-18 16:02:48', NULL),
(14, 16, '2000- The cult changing era in Bollywood', '7', '<p>&ldquo;Dekho 2000 Jamana Aa Gaya&rdquo; song from the movie &ldquo;Mela&rdquo; rang the bell on the door of 2000. I saw tremendous changes through the 90s to 2000s. Even though I was a huge fanatic of the movies and music in 90&rsquo;s, I feel that the movies in 2000 had a more developed and diverse kind of story line, directional style, music. Everything was like in the hand of trail blazers.&nbsp; Movies like &ldquo;Kaho Naa Pyar Hai&rdquo;, &ldquo;Lagaan&rdquo;, and &ldquo;Gadar&rdquo; plant the seeds of the bear fruit. A realistic storyline was the mainstream of the films in 2000.</p>\r\n\r\n<p>This era had really turned out to be a cult changing. There were films like &ldquo;Rehena Hai Tere Dil Main&rdquo;, &ldquo;Dil Chahata Hai&rdquo; changed the trend of Bollywood. All the flavours of human emotions were properly showcased in the movies like &ldquo;Black&rdquo;, &ldquo;Monsoon Wedding&rdquo;, &ldquo;Kal Ho Na Ho&rdquo; etc. All the movies in this era had their own unique identity. &nbsp;The image of the hero from this era has changed from sweet and soft spoken person to a masculine rigid personality; they started to exercise more at a gym to build their hot steamy body, to acquire abs. Comedy genre also touched a zenith milestone when Priyadarshan directed comedy-drama &ldquo;<em>Hera Pheri</em>&rdquo; released in 2000. Also, there were some inspirational movies like &ldquo;<em>Udaan</em>&rdquo;, &ldquo;<em>Rocket Singh: Salesman of the Year</em>&rdquo;, &ldquo;<em>3 Idiots</em>&rdquo; brought different colours in the life of Indian cinema. &ldquo;Rang De Basanti&rdquo;, &ldquo;Swades&rdquo;, &ldquo;Chak De India&rdquo;, &ldquo;Slumdog Millionaire&rdquo; were the films that make us all Indian proud. When it comes to realistic core acting there are only a few names that echoed in my ears, few of them &ldquo;Nawazuddin Siddiqui&rdquo; and &ldquo;Irrfan Khan&rdquo;. Despite carrying very ordinary looks, Nawaz was able to gain success in Bollywood only on the guts of acting, his movies like &ldquo;Gangs of Wasseypur&rdquo;, &ldquo;Raman Raghav 2.0&rdquo;, &ldquo;Black Friday&rdquo; succeeded at the box office. Irrfan Khan was also made films like &ldquo;<em>Lunchbox</em>&rdquo;, &ldquo;<em>Madar</em>i&rdquo; which proved him one of the finest and natural actors in the industry.</p>\r\n\r\n<p>The music in this era had a little different taste than the 90&rsquo;s. Indi Pop songs trend which was introduced in late 90&rsquo;s came forward openly in early 2000. Singers like Sonu Nigam, Aalisha Chinnoy, Shaan, Falguni Pathak, Euphoria, Aaryans, and Bombay Vikings created most fresh fruit like pop songs and albums in early 2000. The way those songs were shot was also in &ldquo;fantasy comes true&rdquo; fashion. In most of the songs the story used to revolve around the Hero and Heroine, and how they express their love in most sweet and romantic way. Songs also had the same flavour of sweetness and love. But gradually this sweetness and softness of compositions converted into bitterness in the movies past 2009-2010. Adopted from western country&rsquo;s Hip hop and Rap style, was introduced by Yo Yo Honey Singh, Badshah in India past 2010. The quality level of lyrics also decreased in those songs. But today&rsquo;s generation like this music most. They have nothing to do with the music, all they like high beat music with fast rapping style. But I really thank some saviors singers of this generation like Arijit Singh, Rahat Fateh Ali Khan, Arman Malik, they still believe in melodious and Sufi composition, which is decent to listen and lyrics of the songs also not the worst thing in the industry.</p>\r\n\r\n<p>This era may not have an ever greenness as 90&rsquo;s or before, but this era had given us different shades of stories, acting skill, and music. &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '5996c811a591e259.jpg', NULL, 'N', NULL, NULL, 'N', '2017-08-18 16:27:21', NULL),
(15, 16, 'Dasvidaniya (2008) Review', '7', '<p><strong>Cast:</strong> <a href=\"https://en.wikipedia.org/wiki/Vinay_Pathak\">Vinay Pathak</a>, <a href=\"https://en.wikipedia.org/wiki/Neha_Dhupia\">Neha Dhupia</a>, <a href=\"https://en.wikipedia.org/wiki/Rajat_Kapoor\">Rajat Kapoor</a>,<a href=\"https://en.wikipedia.org/wiki/Ranvir_Shorey\">Ranvir Shorey</a>, <a href=\"https://www.google.co.in/search?sa=X&amp;biw=1024&amp;bih=662&amp;q=Sarita+Joshi&amp;stick=H4sIAAAAAAAAAOPgE-LSz9U3MC7MMzRKUQKzTdIMjSxMtCSzk630C1LzC3JSgVRRcX6eVUFiUWpeSTEAC1Jd4jUAAAA&amp;ved=0ahUKEwjgmP38ydvVAhWKPI8KHUCDAY8QmxMItAEoATAW\">Sarita Joshi</a>, <a href=\"https://www.google.co.in/search?sa=X&amp;biw=1024&amp;bih=662&amp;q=Saurabh+Shukla&amp;stick=H4sIAAAAAAAAAOPgE-LSz9U3yKrMMysuUAKzjcyyyywytCSyk630C1LzC3JSgVRRcX6eVXFBfmlxKgBDHqQcNAAAAA&amp;ved=0ahUKEwjvmOKRytvVAhUIMI8KHfaoDZYQmxMIlAEoATAT\">Saurabh Shukla</a>, <a href=\"https://en.wikipedia.org/wiki/Gaurav_Gera\">Gaurav Gera</a>.</p>\r\n\r\n<p><strong>Director: </strong>Shashant Shah.</p>\r\n\r\n<p><strong>Synopsis: </strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The story is all about the 37 years old mid-aged Amar Kaul (Vinay Pathak), an account manager who works at Pharmaceuticals Company. He lives with his widowed mother. Being unmarried and not having any sense of living, he becomes the man of nondescript and mundane nature. He likes to make a to-do list of his daily work. His mean boss Dasgupta (Saurabh Shukla) never misses fire to insult him. One day Amar discovers from his doctor that he is suffering from an atrocious stomach cancer and has only 3 months to live. Obviously, he feels blue. But knowing that he is going to say goodbye to the world soon, he makes a list of 10 things to do before he dies. And embark his quest towards the accomplishment of his dream wishes. While doing this he finds true joy of a life. And by the time of his death, he has achieved everything that was on his list and left those wishes for his loved and dear ones.</p>\r\n\r\n<p><strong>Review:</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>When I saw the name of Shashant Shah as a director of the film, I didn&rsquo;t know who he is. But the film itself gave me an identity of him. He brought different colours of life in a very realistic way in this movie. All the little pieces of human&rsquo;s nature gently portrayed by protagonist Vinay Pathak. The other actors who played a side role in this movie also helped significantly Vinay to lavish the film. Versatile Actor Rajat Kapoor played a role of Rajiv Jhulka a dear infancy friend of Amar Kaul, acted superbly as a Doctor, who lives abroad. The genuine care that he expresses about Amar&rsquo;s health seems pretty real. Saurabh Shukla who played Dasgupta a mean boss of Amar also gave his natural efforts to made Amar quit his job. All other characters like Neha Banot (Neha Dhupia) who is puppy love of Amar, Maa (Sarita Joshi) a careful but little wacky mother who is always into the TV serials, Vivek Kaul (Gaurav Gera) a younger brother who got exclude from the house by his mother because he married to the girl from different cast, all the actors supported exquisitely to the team. The directional style is little unorthodox but positively beaming. The story writer Arshad Syed has crafted a story in every genetic way. The story gives us an apparent idea of middle-class family and a family person who lives in Mumbai. The main character Amar Kaul justified the core of the story. The characteristics of Amar like self-centered, reticent etc. actually symbolize a person who is self-involved. The film doesn&rsquo;t seem slow or off the track anywhere. When Amar finally realizes the huge quandary in his life i.e. Stomach Cancer at 3rd stage, the scene really stuck audience emotionally. The music composed by Kailash Kher is also has a decent touch. The song &ldquo;O Maa Meri Maa Pyaari Maa - Mammaa&rdquo; enlightens and freshens up the mood.</p>\r\n\r\n<p>Although this movie wasn&rsquo;t a big hit at box office, many critics have appreciated the movie and the especially work of Vinay Pathak.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n', '5996c8f74d08d992.jpg', NULL, 'N', NULL, NULL, 'N', '2017-08-18 16:31:11', NULL),
(16, 16, 'Homearts FB Blog', '7', '<p>Let interior create the story for your house.</p>\r\n\r\n<p>You buy the house to see yourself living in that house, but that just for your livelihood. But what about the fairy-tale about your house that you must have imagined before you buy your house? Everybody has their fairy-tale about their houses, and we are the initiator of your fairy-tale of the house. And we make sure that your fairy-tale has a perfect climax ending.</p>\r\n\r\n<p>&nbsp;Interior gives your house vivid kinds of angles that may change your angle to look at your house in a very pleasant way. Colours can be a vital ravel between the rooms in your house. We design your rooms in such way that colours can shade your emotions with your house. A Blend of colours is the mainstream of the interior. Perfectly arranged things in your house can give your house a neatly look, but that just not enough. Only the neat look can be boring, neatness always compliments beautifulness. Glitter your house with the little beauties like hanging lamps that enlighten your room aura, lovely flyers that portray your little notes in a most endeavor-less way, splendid cushions that can create most candid motion of yours, whilst you are lying on the bed. There are so many other ways to decorate your house with our joker card, all you need to do is just to contact us and express your unique idea for fairy-tale of yours, and we are ready to create a story with our own characters. And just remember one thing that &ldquo;Looks can be deceptive&rdquo;, but we are not.</p>\r\n\r\n<p>On that note, we would like to sign off for now.</p>\r\n\r\n<p>Regards,<br />\r\nHomeart Concepts</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '5996c9b80485b326.jpg', NULL, 'N', NULL, NULL, 'N', '2017-08-18 16:34:24', NULL),
(17, 16, 'A Lure of youth towards the vocational courses.', '7', '<p>&nbsp;Education in these days has become the most significant facet in India. There are much more courses existed than the states in India. We see this age as a most educated age of Indian history. Each and every advance educational programme runs by different institutions of an India. Every year numerous numbers of Grads are passed out from different colleges. But then what they do after?</p>\r\n\r\n<p>According to the article of &ldquo;The Times of India&rdquo; dated 14th August 2017, MBA graduates in India are facing arduous problems to get a job. The survey says that one in every two of MBAs in India fails to get a job. Stats also show that the class of 2016 saw 75,658 students get jobs on campus. But there is no clarity on what happened to the equally large number of those who signed up for the courses in 3080 colleges spread across India.</p>\r\n\r\n<p>Let&rsquo;s consider an MBA course for consideration. The MBA programme is considered to be a fanciest and lucrative course in India, those who want to be the successful businessman or someone who really wants to imprint their crafts in management, usually choose an MBA as a pavement. There are so many big B-Schools like IIM which conduct an MBA course. But this approach can be deceptive for some people. Many enrolled for an MBA just because they see it as a money making machine, or someone does it because their parents told them, or many joined MBA to get a White Collar respect. But are these the real reasons for working? Of course not, unless and until you are passionate about it.</p>\r\n\r\n<p>But there are some youngsters or even middle-aged persons, who are stuck in the wrong place from the yore time. Their passion might be something else and they are doing something else. Passion is what they have missed out on. These folks may know what they actually wanted to do in their life but never got a chance to fulfil their passionate dream or may never show courage to justify their passion. These people surely are regretting their decision somewhere. For instance, a guy who works at IT company from past 2 years, and may now realise that singing is the sea, which he always sees. Sometimes these want to be out of box thinkers might be reluctant to jump out the box for the obvious reasons.</p>\r\n\r\n<p>But this is where Cast India comes into the picture. Cast India is a platform for the aspiring artist, where all kinds of artists are welcome gladly. Cast India will help the astonishing talented aspiring artist who really wants to build their milestone in the creative field. Cast India will help all the ambitious applicants to cope up with the recruiter in the field of an art. Cast India offers its service to all artists including actor, model, singer, cinematographer, photographer, editor, writer etc. All you need to do is, just visit our website <a href=\"http://www.castindia.in\">www.castindia.in</a> and register yourself as a recruiter or applicant.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '5996ca342e081194.jpg', NULL, 'N', NULL, NULL, 'N', '2017-08-18 16:36:28', NULL),
(18, 16, 'Black and White Era', '7', '<p>Whenever I heard the word &ldquo;Black and White Movies&rdquo;, my subconscious mind shows me the pictures of movies in the decade of 50&rsquo;s. Even though I did not get an honour to feel the real existence of black and white movies, I still could watch all the movies and songs that had been recorded and shoot in black and white colour technology, thanks to the advanced technology that has arisen in these days. But you can only watch those movies now on the internet, but you cannot take the full joy of it as you are habitat to the colours movies of this modern and advanced age. Some people might have found these movies boring and outdated. But true cine lover can tell you the real magic of Black era.</p>\r\n\r\n<p>Black and white era was known as a Golden Era. The reason behind this was pretty obvious. The film styles back then were simple as a dimple, and clean as a slate. Storylines had its own tender touch of Indian society back then. No violence, no action, not steamy romance as compared to today&rsquo;s films. But despite all of the things movies from the golden era still feel like a real gold in our hand. Veteran actors like &ldquo;The showman Raj Kapoor&rdquo;,&rdquo; Nargis Dutta&rdquo;,&rdquo;Dilip Kumar&rdquo; and Dev Anand actually invented the phrase &ldquo;Sweet but simple&rdquo; by their innocent acting. As India was recently got a freedom, movies were also depicted the situation in India. Black and white mean only two colours (and no other colours) that were used to create a movie, but we could still see the different colours of a real acting acted by the actors and actresses of that time. It was the prime time of Bollywood.</p>\r\n', '5996cb01548db454.jpg', NULL, 'N', NULL, NULL, 'N', '2017-08-18 16:39:53', NULL),
(19, 17, 'Art', '1', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;MUSING THE VIEWED</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Friday 11, August 2017, an amazing event presented by Art2 day art gallery with the greatest artists, Arti kirloskar, Bharati Pittre and Snehal Chordia Goyal to tell about their experiences and many different art forms which they encountered in Documenta 14 in Germany which happens in every 5 years &amp; also known as &ldquo; museum for 100 days&rdquo;. There were many different artists with their creativity and amazing art forms.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; One of them was Martha Minujin&rsquo;s, painter, sculpture artist and performing artist created&rdquo; the Parthenon of Books&rdquo;. The Parthenon is made out of forbidden books and the books of authoress who have been persecuted, it was built in Athen&rsquo;s the reason it was created because under Nazi rule in Germany there were 30 thousand books which were burned thinking that the books were ungerman spirit. The Parthenon is still setting up artist has requested people to donate all the forbidden books.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; From Montegomery, West Virginia Annie Sprinkie and Beth Stephens who is a porn star, depicted their past life how it was as a sex worker and what all they went through in their life journey, in a form of miniature paintings and poems which were really sensitive. These two girls initiated 7 years project for public quarrying rituals, where they married to the Earth, Sun, Moon, Trees, Rivers and lakes to collaborate with nature love and create mutual &amp; sustainable relationship. The thought behind this art is very interesting as we see in India artist from all these backgrounds are not accepted easily.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Another, fascinating art was created by Architecture Hiwa K with the collaboration of product designing students of Kassel. These were vitrified clay pipes, the idea behind of creating this was to depict the poverty and what happens when a Pearson has no longer his own home or shelter to stay, which we see something similar in India, when a Pearson is homeless or there is no shelter they live in these kinds of pipes. These vitrified pipes were meant to be a kind of hotel where there were bed rooms, kitchens, washrooms and also a library where people could come eat, read, cook and stay.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; There were many more artists with different art forms and new ideas which we could never think off or see something like this before. This shows how things have changed from the past and how art and different art forms have evolved. These artists and their art forms have made us think more than beyond.&nbsp;</p>\r\n', '599a992c67d0f935.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-08-21 13:52:18', '2017-08-21 14:37:52');
INSERT INTO `blogs_published` (`id`, `blog_user_id`, `blog_title`, `blog_category_id`, `description`, `blog_images`, `gallary_images`, `approve`, `update_flag`, `update_by`, `delete_flag`, `date_created`, `date_updated`) VALUES
(20, 17, 'Fashion and Youth', '4', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; FASHION AND YOUTH</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When we talk about fashion or any fashion trend, the very first thing which struck, our mind is a flash of colour&rsquo;s, comfort and with a touch of glamour to it. Every human desire&rsquo;s to look good and feel accepted in the social economic circle, Fashion plays an important part in today&rsquo;s young youth.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;In this 21st modern era youth are updated with the current fashion trend&rsquo;s beat clothing, hairstyles, make ups or rather trendy shoes. Their very first inspiration of fashion comes from the Celebrities either from Bollywood or Hollywood. They look up to celebrities for many different reasons. For girls, it is usually for the beauty and the way the female actress dresses and for boys, it is usually muscles and keen fashion sense of famous men that they aspire to have, which means leaving a classy life. As fashion has evolved past decades for some youth fashion not only means keeping up with trends or wearing some designer cloths, for them fashion does not necessarily mean glamour it is more about life and reflection of inner beauty with comfort in it.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;If we look on the other part of it, there are many trends and clothing line which are fashionable yet have a touch of comfort to it. Well, if we see the Indian Fashion designer like Rohit BAL, Sabbhaya Sachi, Ritu kumar and Manish Malhotra there collection is fashionable but there is a comfort given to the clothes, as these designers come from Indian background there is also traditional, touch given to their collections. As India is rich with different types of culture there are many cloths which are inspired by Indian culture such as Chikankari work, crewel, traditional weaves, bandhani prints and zardos which are constantly used by our Indian Fashion designers in there indo &ndash; Western clothing Young youth can choose from the best of East and West as Indian designers are inspired by both Indian and Western style.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;In India, Fashion is a big umbrella where there is a whole range of clothing for traditional wedding ceremonies, parties, casuals and also for sports. T- Shirts, jeans and various kinds of casual cloths which are known to be the trend setter of fashion in India. Today new fashion trends are giving confident to young youth and inspire them to think &amp; do what they want but on the other hand there are some negative effects which are affecting them. In order to achieve the current style statement of the celebs, they start, Spending their money to buy new clothes as soon the new trend come in, ends up in big loss of money and heavy financial burden on the parents. To fit into skin tight dresses, girls often start dieting which can cause bad effect on their body and mind.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Like every coin as two faces, similarly effect of, Fashion on youth both positive and negative, but if we compare the past and the present fashion trends there are lots of changes which we could see over the decades. Youth have started looking at fashion with, different mind-set, not only in India, but also the world has seen the changes in fashion statements for both women and men.</p>\r\n', '599ac6605da65365.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-08-21 13:59:02', '2017-08-21 17:09:12'),
(28, 16, 'Unorthodox stays out of the box.', '5', '<p>Work of yours always engraves your identity. The identity which will remain with you till you breathe your last. Work can be anything but you must know what your instinct has to say about the work. In India, there are many domains where you could work wonders. Evidently, you have to be educationally eligible to get into some of those domains. This is what our Indian education system believes in so. Having knowledge about your knowledge of interest can take you one step closer to the road of your dream. The sometimes deceptiveness of your dream can become the thorn in your road of dreams and can lead to you in the sea of unknown. Beware what you are wishing for, and attire a shoe which will walk to your aspiration.</p>\r\n\r\n<p>I, myself caught in the same kind of quandary. As a child, I had a very ordinary personality, I wasn&rsquo;t good at studies, not even in the sports, and definitely, I wasn&rsquo;t good at charm and talkative act. Still, I survived the schooling. I choose commerce stream when I got into the college. Despite being passed out 10th with very poor grades, I had a chance to select science stream. But I still decided to choose commerce stream knowing that I was awful at science and maths in school. I think that was the first right decision that I took in my entire life. Nobody forced me to do any particular studies. That was a great thing about my parents, they have always told me that do anything you want to but whatever it is that you do, do it with the passion with honesty. No work has the highest dignity than your dignify approach of work. But blaming no one, I ended up being a postgraduate from an IT. I never see myself as a software developer. Despite this fact, I have worked in the IT industry for almost two years.</p>\r\n\r\n<p>While working, I have always tried to get out of it, but the circumstances weren&rsquo;t allowing me to do so. Finally, I got a chance to show my unorthodoxy-ness when I had to leave my job due to my personal problems. Later, I was unemployed for the six months. Each day of those six months was like a judgment day for me. I often used to panic as days passed and I couldn&rsquo;t find a job. Although I kept trying, success always remains inch short from me. The night time was crucial to not to study and watch movies. I always used to watch movies at night. Gradually I started realizing my potential for writing while watching movies. I started shrewdly observing every tiny detail in the content of the movies and thought to give myself a chance in the area of writing. I tied the knot of preparation very tight, and I decided to release it only after I put my step into a sea of writing. I also started to apply for the job opportunities in writing (specifically content writing). I made my cushion a driver seat and made my laptop a windshield and started my journey towards my favourite destination known as writing. As a total rookie in the field of writing, I never been entertained by any recruiter. Some of them gave me an opportunity to get into it but still, I couldn&rsquo;t reach the level of their expectations. Again I started drowning in the pond of sorrow and depression. I even thought to get back at my old job, but another side of mind kept telling me that don&rsquo;t give up on your dream, keep striving, learn to fall in love with the odds, and I decided to go with my instincts. Up until that moment, my approach towards getting a job was quite emotional. Then I altered my approach a little bit. I started thinking practically and analyzed my problem. As I knew, I am not getting a job in writing due to so many factors. So I decided to go for an internship for a content writing. I dug into some information related to an internship. God bless internet system that I found the portal named &ldquo;Internshala&rdquo; which was a perfect podium for a guy like me. I have applied for so many companies, but &ldquo;Cast India&rdquo; turned out to be a real saviour for me. Cast India recognized my potential, my hunger for the writing, and hired me as an intern. I am very thankful to the Cast India for giving me the spot in their family. Today I have completed one month here at Cast India. I have learned so many things in this one month I have also experienced a new culture at Cast India. I must say, my hard work and my worship for work brought happy colours in my life. As the old Indian proverb &ldquo;While the house God is an injustice not&rdquo; I have literally experienced the power of this proverb.</p>\r\n\r\n<p>All I want to say that, you should break your silence of your dream. Think and jump outside the box to achieve your dream. Be unorthodoxy. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '59b6925a44960126.gif', NULL, 'Y', NULL, NULL, 'N', '2017-09-11 19:06:14', '2017-10-04 11:24:34'),
(21, 16, 'The magical age of Bollywood- 90’s', '3', '<p>I still remember I was 4 years old since I started to listen to the songs. Back in those years (1994-1999) there was a magical gadget existed, an audio cassette. I found the gadgets very intrigued, as it was small in size and could embrace many songs in it. I used to just intrude these cassettes in tape-recorder and used to listen to them for hours. My favorite song back then was &ldquo;<em>ye kali kali aankhen</em>&rdquo; from the romantic-action thriller &ldquo;Baaziger&rdquo;. And of course, I was a big fan of Shah Rukh Khan. The way he used to act with all his serious, charm attributes, he simply imprinted himself as a good actor with good looks. I always used to adore him, and also tried to imitate him, like in his dialogue &ldquo;<em>kkk kirrann...&rdquo;</em> from his epic Thriller-Romantic &ldquo;Darr&rdquo;.</p>\r\n\r\n<p>Those sweet-sounding compositions also made a positive effect on the movies at that time. The 1990&rsquo;s Musical-Romance &ldquo;Aashiqui&rdquo;, all the songs that are in the films were originally supposed to be on the album, songs were already recorded by duo-composer Nadeem-Shravan. But when director producer Mr. Mahesh Bhatt listened to those songs, he was so stunned that he asked Gulshan Kumar to relinquish the album and make a movie for these songs. The Movie got released and rest is the history. Singers like Kumar Sanu had emerged from the movie &ldquo;Aashiqui&rdquo;. His unique melodious voice with little nasal touch in his voice made him a top singer at that time. His voice and tonal quality were alike the voice of legendary singer Kishore Kumar.</p>\r\n\r\n<p>This decade also gave us numerous superstars of Bollywood like Shah Rukh Khan, Ajay Devgan, Akshay Kumar, Saif Ali Khan, etc. All other movies in the 90&rsquo;s were the genre of family melodrama, romance and action-packed. Film director like Suraj Barjatya and Rajkumar Santoshi were specialized in family melodrama. Films like &ldquo;<em>Hum Aap Ke Hai Kaun</em>&rdquo;, &ldquo;<em>Hum Sath Sath Hai</em>&rdquo;, &ldquo;<em>Swarg</em>&rdquo;, and &ldquo;<em>Ghar ho to Aisa</em>&rdquo; got vivid popularity in the middle class as well as the rich class family audience. Those were the films that an entire family could watch together. If anyone wonders that who were the actors from 90&rsquo;s made us all go like LOL? Definitely, anyone can answer, that&rsquo;s &ldquo;Govinda&rdquo;. His hilarious face expression and quirky dialogue style literally made me laugh my lungs out. His all-time favorite movies like &ldquo;<em>Raja Babu</em>&rdquo;, &ldquo;<em>Hero No1</em>&rdquo;, &ldquo;<em>Aankhen</em>&rdquo;, &ldquo;<em>Dulhe Raja</em>&rdquo; still bring candid laughter on our face. Then there was Akshay Kumar who was known as an Action Hero, acted in some of the action films like &ldquo;<em>Khiladi Series</em>&rdquo;. On the other hand was Ajay Devgan, famous for his serious acting skills.</p>\r\n\r\n<p>Anybody can say anything, but I personally feel that 90&rsquo;s era was the golden blend of all genre of entertainment. It was probably the last best era of Bollywood. The era really made my childhood awesome.</p>\r\n', '599abb328b029329.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-08-21 14:41:07', '2017-08-21 16:21:30'),
(22, 16, '2000- The cult changing era in Bollywood.', '3', '<p>&ldquo;Dekho 2000 Jamana Aa Gaya&rdquo; song from the movie &ldquo;Mela&rdquo; rang the bell on the door of 2000. I saw tremendous changes through the 90s to 2000s. Even though I was a huge fanatic of the movies and music in 90&rsquo;s, I feel that the movies in 2000 had a more developed and diverse kind of storyline, directional style, music. Everything was like in the hand of trailblazers.&nbsp; Movies like &ldquo;Kaho Naa Pyar Hai&rdquo;, &ldquo;Lagaan&rdquo;, and &ldquo;Gadar&rdquo; plant the seeds of the bear fruit. A realistic storyline was the mainstream of the films in 2000.</p>\r\n\r\n<p>This era had really turned out to be a cult changing. There were films like &ldquo;Rehena Hai Tere Dil Main&rdquo;, &ldquo;Dil Chahata Hai&rdquo; changed the trend of Bollywood. All the flavours of human emotions were properly showcased in the movies like &ldquo;Black&rdquo;, &ldquo;Monsoon Wedding&rdquo;, &ldquo;Kal Ho Na Ho&rdquo; etc. All the movies in this era had their own unique identity. &nbsp;The image of the hero from this era has changed from sweet and soft spoken person to a masculine rigid personality; they started to exercise more at a gym to build their hot steamy body, to acquire abs. Comedy genre also touched a zenith milestone when Priyadarshan directed comedy-drama &ldquo;<em>Hera Pheri</em>&rdquo; released in 2000. Also, there were some inspirational movies like &ldquo;<em>Udaan</em>&rdquo;, &ldquo;<em>Rocket Singh: Salesman of the year</em>&rdquo;, &ldquo;<em>3 Idiots</em>&rdquo; brought different colours in the life of Indian cinema. &ldquo;Rang De Basanti&rdquo;, &ldquo;Swades&rdquo;, &ldquo;Chak De India&rdquo;, &ldquo;Slumdog Millionaire&rdquo; were the films that make us all Indian proud. When it comes to realistic core acting there are only a few names that echoed in my ears, few of them &ldquo;Nawazuddin Siddiqui&rdquo; and &ldquo;Irrfan Khan&rdquo;. Despite carrying very ordinary looks, Nawaz was able to gain success in Bollywood only on the guts of acting, his movies like &ldquo;Gangs of Wasseypur&rdquo;, &ldquo;Raman Raghav 2.0&rdquo;, &ldquo;Black Friday&rdquo; succeeded at the box office. Irrfan Khan was also made films like &ldquo;<em>Lunchbox</em>&rdquo;, &ldquo;<em>Madar</em>i&rdquo; which proved him one of the finest and natural actors in the industry.</p>\r\n\r\n<p>The music in this era had a little different taste than the 90&rsquo;s. Indi Pop songs trend which was introduced in late 90&rsquo;s came forward openly in early 2000. Singers like Sonu Nigam, Alisha Chinnoy, Shaan, Falguni Pathak, Euphoria, Aaryans, and Bombay Vikings created most fresh fruit like pop songs and albums in early 2000. The way those songs were shot was also in &ldquo;fantasy comes true&rdquo; fashion. In most of the songs the story used to revolve around the Hero and Heroine, and how they express their love in most sweet and romantic way. Songs also had the same flavour of sweetness and love. But gradually this sweetness and softness of compositions converted into bitterness in the movies past 2009-2010. Adopted from western country&rsquo;s Hip hop and Rap style, was introduced by Yo Yo Honey Singh, Badshah in India past 2010. The quality level of lyrics also decreased in those songs. But today&rsquo;s generation like this music most. They have nothing to do with the music, all they like high beat music with fast rapping style. But I really thank some saviors singers of this generation like Arijit Singh, Rahat Fateh Ali Khan, Arman Malik, they still believe in melodious and Sufi composition, which is decent to listen and lyrics of the songs also not the worst thing in the industry.</p>\r\n\r\n<p>This era may not have an ever greenness as 90&rsquo;s or before, but this era had given us different shades of stories, acting skill, and music. &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '599abd354c008312.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-08-21 14:47:33', '2017-08-21 16:30:05'),
(23, 16, 'Black and white era', '3', '<p>Whenever I heard the word &ldquo;Black and White Movies&rdquo;, my subconscious mind shows me the pictures of movies in the decade of 50&rsquo;s. Even though I did not get an honour to feel the real existence of black and white movies, I still could watch all the movies and songs that had been recorded and shoot in black and white colour technology, thanks to the advanced technology that has arisen in these days. But you can only watch those movies now on the internet, but you cannot take the full joy of it as you are habitat to the colours movies of this modern and advanced age. Some people might have found these movies boring and outdated. But true cine lover can tell you the real magic of Black era.</p>\r\n\r\n<p>Black and white era was known as a Golden Era. The reason behind this was pretty obvious. The film styles back then were simple as a dimple, and clean as a slate. Storylines had its own tender touch of Indian society back then. No violence, no action, not steamy romance as compared to today&rsquo;s films. But despite all of the things movies from the golden era still feel like a real gold in our hand. Veteran actors like &ldquo;The showman Raj Kapoor&rdquo;,&rdquo; Nargis Dutta&rdquo;,&rdquo;Dilip Kumar&rdquo; and Dev Anand actually invented the phrase &ldquo;Sweet but simple&rdquo; by their innocent acting. As India was recently got a freedom, movies were also depicted the situation in India. Black and white mean only two colours (and no other colours) that were used to create a movie, but we could still see the different colours of a real acting acted by the actors and actresses of that time. It was the prime time of Bollywood.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '599abe43265b4701.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-08-21 14:52:54', '2017-08-21 16:34:35'),
(24, 16, 'Dasvidaniya (2008) Review', '3', '<p><strong><em>Dasvidaniya (2008)</em></strong></p>\r\n\r\n<p><strong>Cast:</strong> <a href=\"https://en.wikipedia.org/wiki/Vinay_Pathak\">Vinay Pathak</a>, <a href=\"https://en.wikipedia.org/wiki/Neha_Dhupia\">Neha Dhupia</a>, <a href=\"https://en.wikipedia.org/wiki/Rajat_Kapoor\">Rajat Kapoor</a>,<a href=\"https://en.wikipedia.org/wiki/Ranvir_Shorey\">Ranvir Shorey</a>, <a href=\"https://www.google.co.in/search?sa=X&amp;biw=1024&amp;bih=662&amp;q=Sarita+Joshi&amp;stick=H4sIAAAAAAAAAOPgE-LSz9U3MC7MMzRKUQKzTdIMjSxMtCSzk630C1LzC3JSgVRRcX6eVUFiUWpeSTEAC1Jd4jUAAAA&amp;ved=0ahUKEwjgmP38ydvVAhWKPI8KHUCDAY8QmxMItAEoATAW\">Sarita Joshi</a>, <a href=\"https://www.google.co.in/search?sa=X&amp;biw=1024&amp;bih=662&amp;q=Saurabh+Shukla&amp;stick=H4sIAAAAAAAAAOPgE-LSz9U3yKrMMysuUAKzjcyyyywytCSyk630C1LzC3JSgVRRcX6eVXFBfmlxKgBDHqQcNAAAAA&amp;ved=0ahUKEwjvmOKRytvVAhUIMI8KHfaoDZYQmxMIlAEoATAT\">Saurabh Shukla</a>, <a href=\"https://en.wikipedia.org/wiki/Gaurav_Gera\">Gaurav Gera</a>.</p>\r\n\r\n<p><strong>Director: </strong>Shashant Shah.</p>\r\n\r\n<p><strong>Synopsis: </strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The story is all about the 37 years old mid-aged Amar Kaul (Vinay Pathak), an account manager who works at Pharmaceuticals Company. He lives with his widowed mother. Being unmarried and not having any sense of living, he becomes the man of nondescript and mundane nature. He likes to make a to-do list of his daily work. His mean boss Dasgupta (Saurabh Shukla) never misses fire to insult him. One day Amar discovers from his doctor that he is suffering from an atrocious stomach cancer and has only 3 months to live. Obviously, he feels blue. But knowing that he is going to say goodbye to the world soon, he makes a list of 10 things to do before he dies. And embark his quest towards the accomplishment of his dream wishes. While doing this he finds true joy of a life. And by the time of his death, he has achieved everything that was on his list and left those wishes for his loved and dear ones.</p>\r\n\r\n<p><strong>Review:</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>When I saw the name of Shashant Shah as a director of the film, I didn&rsquo;t know who he is. But the film itself gave me an identity of him. He brought different colours of life in a very realistic way in this movie. All the little pieces of human&rsquo;s nature gently portrayed by protagonist Vinay Pathak. The other actors who played a side role in this movie also helped significantly Vinay to lavish the film. Versatile Actor Rajat Kapoor played a role of Rajiv Jhulka a dear infancy friend of Amar Kaul, acted superbly as a Doctor, who lives abroad. The genuine care that he expresses about Amar&rsquo;s health seems pretty real. Saurabh Shukla who played Dasgupta a mean boss of Amar also gave his natural efforts to made Amar quit his job. All other characters like Neha Banot (Neha Dhupia) who is puppy love of Amar, Maa (Sarita Joshi) a careful but little wacky mother who is always into the TV serials, Vivek Kaul (Gaurav Gera) a younger brother who got exclude from the house by his mother because he married to the girl from different cast, all the actors supported exquisitely to the team. The directional style is little unorthodox but positively beaming. The story writer Arshad Syed has crafted a story in every genetic way. The story gives us an apparent idea of middle-class family and a family person who lives in Mumbai. The main character Amar Kaul justified the core of the story. The characteristics of Amar like self-centered, reticent etc. actually symbolize a person who is self-involved. The film doesn&rsquo;t seem slow or off the track anywhere. When Amar finally realizes the huge quandary in his life i.e. Stomach Cancer at 3rd stage, the scene really stuck audience emotionally. The music composed by Kailash Kher is also has a decent touch. The song &ldquo;O Maa Meri Maa Pyaari Maa - Mammaa&rdquo; enlightens and freshens up the mood.</p>\r\n\r\n<p>Although this movie wasn&rsquo;t a big hit at box office, many critics have appreciated the movie and the especially work of Vinay Pathak.</p>\r\n', '599abf643d6c1207.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-08-21 14:56:02', '2017-08-21 17:49:56'),
(25, 16, 'Homearts FB Blog', '1', '<p>Let interior create the story for your house.</p>\r\n\r\n<p>You buy the house to see yourself living in that house, but that just for your livelihood. But what about the fairy-tale about your house that you must have imagined before you buy your house? Everybody has their fairy-tale about their houses, and we are the initiator of your fairy-tale of the house. And we make sure that your fairy-tale has a perfect climax ending.</p>\r\n\r\n<p>&nbsp;Interior gives your house vivid kinds of angles that may change your angle to look at your house in a very pleasant way. Colours can be a vital ravel between the rooms in your house. We design your rooms in such way that colours can shade your emotions with your house. A Blend of colours is the mainstream of the interior. Perfectly arranged things in your house can give your house a neatly look, but that just not enough. Only the neat look can be boring, neatness always compliments beautifulness. Glitter your house with the little beauties like hanging lamps that enlighten your room aura, lovely flyers that portray your little notes in a most endeavour-less way, splendid cushions that can create most candid motion of yours, whilst you are lying on the bed. There are so many other ways to decorate your house with our joker card, all you need to do is just to contact us and express your unique idea for fairy-tale of yours, and we are ready to create a story with our own characters. And just remember one thing that &ldquo;looks can be deceptive&rdquo;, but we are not.</p>\r\n\r\n<p>On that note, we would like to sign off for now.</p>\r\n\r\n<p>Regards,<br />\r\nHomeart Concepts</p>\r\n', '599ac0420cb88653.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-08-21 15:00:09', '2017-08-21 16:43:06'),
(26, 16, 'Indian Cinema - An emerging voyage', '3', '<p>The Indian cinema has a great essence of its own past glory. The first motion picture back then released as a silent movie named &ldquo;Raja Harishchandra&rdquo;. The Film was produced and directed by Late Mr. Dadasaheb Phalke, who is known as a pioneer of Indian film industry. Film released on 3rd&nbsp;May 1913 and was shown at the Coronation Cinematograph, Mumbai (back then known as Bombay). &nbsp;From then the journey of an Indian cinema had begun.</p>\r\n\r\n<p>Soon Hindi cinema started to known as a Bollywood. Bollywood has its own&nbsp;flavour&nbsp;of trends. And these trends kept changing through the years. Film making trends changed as specific time era has passed. Indian films can be categorized into 4 categories defined by the time span. I will explain these in brief.</p>\r\n\r\n<p>The first era of the Indian cinema began after the release of the first Indian sound film &ldquo;Alam Ara&rdquo;. This era involves the movies that have been made from 1940 to 1960. Movies made in this period had a story of a common or poor man, and a story would show how the &ldquo;Hero&rdquo; aka common man of the film strives against his problems he faces, how he struggles to conquer over his worst condition. This genre of a story would make an immense impact on the audience, and hence audience would relate to the protagonists from a movie to themselves as most of the citizens of India back then used to belong to poor or ordinary families. This combo of characters in films and audience led film industry into the laps of success. This era was made famous by its name &ldquo;Golden era&rdquo;. Movies like Awara(1951), Shree 420(1955) and Mother India(1957) were critically acclaimed and said to be successful Blockbusters as well. The actors from this era used to believe in method acting only. Actors and actresses like Raj Kapoor and Nargis Dutta were at the top of the pyramid of popularity as well as success. Actors from this era were sober to look with a moustache at their disposal. Actresses from this early era had only one thing in their life to follow that to look the very&nbsp;sati-Savitri type, whose scope was limited to their house, family and their husbands.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>The next era that industry gave birth to was a whole lot of into transformation than its preceding era. This era introduced a romance and action thriller genre to the Indian film industry. The Audience seems to like this new genre too. Movies like Aaradhana (1969), Aanand (1970), Bobby (1973) and Sholey (1975) imprinted their mark of success on box office. Actors like Rajesh Khanna, and Amitabh Bachchan, Vinod Khanna had carried this era on their shoulder successfully. Rajesh Khanna got popularity because of his image of a chocolate hero; he gained the popularity mostly in ladies audience. Even though Dev Anand got his breakthrough in late 40&rsquo;s and early 50&rsquo;s, he got recognition as a romantic actor in 60&rsquo;s decade. Films like Manzil, Tere Ghar Ke Samne, Jab Pyar Kisi Se Hota Hai, and Mehal gave him vivid recognition as a romantic hero. This era also will be remembered for the rise of a villain in the film industry. Specifically, Ramesh Sippy&rsquo;s Sholay was one of the movies in which villain got as higher credibility as a hero. Gabbar Singh, played by Late Mr. Amjad Khan not only made this role but also film immortal. Even today people still remember his dialogues like &ldquo;Kitne&nbsp;Aadmi&nbsp;the?&rdquo; The legendary actor Mr. Amitabh Bachchan also emerged in this era. The image of the &ldquo;angry young man&rdquo; was also introduced by him in these decades. This era was all about tremendous changes in the film industry. This era spans the years 1960 to 1980.&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>The next and 3rd&nbsp;era of the Indian cinema was the most exciting and hip happening. This era saw the most diversification of all things that are related to a movie. The advanced technology was used first time in this era. The first Hindi science fiction movie Mr. India starred Anil Kapoor, Shreedevi, And Amrish Puri was released in 1987. The character of Mr. India and Mogambo are still remembered.&nbsp;Amrish Puri&rsquo;s controlling screen existence and high pitched and powerful voice made him stand out amongst the other villains of those days. Late 80&rsquo;s and early 90&rsquo;s era was also determined to be the style altering era of Bollywood.&nbsp; The music in the 90&rsquo;s reverberated on a very large scale on the Hindi movies; it has its different identification than the movies in the past era. The romance creates a different cult in the movies and music in 90&rsquo;s. The stories in those movies usually orbit around the lead hero of the movie. The protagonist fights against the villain, and save his love for a lady. The actors like Shah Rukh Khan, Amir Khan, Salman Khan, and Ajay Devgan. Akshay Kumar and Saif Ali Khan made this era to get going. Each and every one of them has their own image. But the common part between them is that everyone was very good at delivering romance at its best. Music in this era also brought freshness into the light. Composers like Nadeem-Shravan, Jatin-Lalit, Anand-Milind, Anu Malik composed most diversify music in the industry. Even singers like Kumar Sanu, Udit Narayan, Alka Yagnik, Sadhana Sargam, Vinod Rathod made those compositions more saccharine by their chariot like voice. This era is also known as last great era of the music.</p>\r\n\r\n<p>The later era of Indian movies started in the 2000s. The movies in this era mostly depicted on modernization in the country, that&rsquo;s why this era was also called as a modern era of Indian films. The romance was still at the core of storyline of the film, but some new movies introduced different and whacky and realistic storyline of all time. Movies like Dil Chahata Hai(2001), Rehana Hai Tere Dil Main(2001), Ajnabi(2001), Munnabhai MBBS(2003), Slumdog Millionaire(2008) and Gangs of Wasseypur (2012) had set different type of standard in the industry. Music in early 2000s movies had a touch of melodious touch of music, but as industry progress, the movies had lost its melodious touch somewhere. This era also introduced us a fascinating power like advanced technology. Movies like Ra-One (2011), Koi...Mil Gaya (2003), Krrish(2006), Tarzan- The Wonder Car(2005), Bahubali &ndash; The Beginning (2015), Bahubali-The Conclusion(2017) used high technology and animation.</p>\r\n', '599ac3043a9d2980.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-08-21 15:04:07', '2017-08-21 17:50:41'),
(27, 16, 'A Lure of youth towards the vocational courses.', '2', '<p>&nbsp;Education in these days has become the most significant facet in India. There are much more courses existed than the states in India. We see this age as a most educated age of Indian history. Each and every advance educational programme runs by different institutions of an India. Every year numerous numbers of Grads are passed out from different colleges. But then what they do after?</p>\r\n\r\n<p>According to the article of &ldquo;The Times of India&rdquo; dated 14th August 2017, MBA graduates in India are facing arduous problems to get a job. The survey says that one in every two of MBAs in India fails to get a job. Stats also show that the class of 2016 saw 75,658 students get jobs on campus. But there is no clarity on what happened to the equally large number of those who signed up for the courses in 3080 colleges spread across India.</p>\r\n\r\n<p>Let&rsquo;s consider an MBA course for consideration. The MBA programme is considered to be a fanciest and lucrative course in India, those who want to be the successful businessman or someone who really wants to imprint their crafts in management, usually choose an MBA as a pavement. There are so many big B-Schools like IIM which conduct an MBA course. But this approach can be deceptive for some people. Many enrolled for an MBA just because they see it as a money-making machine, or someone does it because their parents told them, or many joined MBA to get a White Collar respect. But are these the real reasons for working? Of course not, unless and until you are passionate about it.</p>\r\n\r\n<p>But there are some youngsters or even middle-aged persons, who are stuck in the wrong place from the yore time. Their passion might be something else and they are doing something else. Passion is what they have missed out on. These folks may know what they actually wanted to do in their life but never got a chance to fulfil their passionate dream or may never show courage to justify their passion. These people surely are regretting their decision somewhere. For instance, a guy who works at IT company from past 2 years, and may now realise that singing is the sea, which he always sees. Sometimes these want to be out of box thinkers might be reluctant to jump out the box for the obvious reasons.</p>\r\n\r\n<p>But this is where Cast India comes into the picture. Cast India is a platform for the aspiring artist, where all kinds of artists are welcome gladly. Cast India will help the astonishing talented aspiring artist who really wants to build their milestone in the creative field. Cast India will help all the ambitious applicants to cope up with the recruiter in the field of an art. Cast India offers its service to all artists including actor, model, singer, cinematographer, photographer, editor, writer etc. All you need to do is, just visit our website <a href=\"http://www.castindia.in\">www.castindia.in</a> and register yourself as a recruiter or applicant.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '599ac3d20f578601.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-08-21 15:06:28', '2017-08-21 16:58:18'),
(29, 16, 'Stand up comedy ', '3', '<p>Comedy is a sweet torture to your cheeks and jaws. Going LOL will always elevate your state of mind in a very nimble mood. I would love to quote this phenomenon as a &ldquo;Comedy is a remedy for any kind of pain&rdquo;. Making people laugh is one of the hardest things to do in the world, and if anyone deciphers the equation to this would be called as a Comedian.</p>\r\n\r\n<p>Indian cinema and television have always seen a churn of comedy in actors like Mehmood, Kishore Kumar, Keshto Mukherjee, Kadar Khan, Govinda, Paresh Rawal, Johny Lever, Rajpal Yadav and the list goes on. This comedian never missed a chance to make us laugh. All of them had their own style to bring the house down. Even though the concept of stand-up comedy paved its seed in the genre of comedy in the 80&rsquo;s, it took comedy almost twenty-five years to grow its tree. In the year of 2005 &ldquo;The Great India Laughter Challenge&rdquo; gained tremendous popularity amidst all types of audience. The stand-up comedian like Raju Shrivastav and Kapil Sharma gave the juicy fruit of comedy in TGILC show. Since then, the stand-up comedy has become inseparable and integral part of a comedy.</p>\r\n\r\n<p>What exactly is a stand-up comedy?</p>\r\n\r\n<p>Here I am stating very obvious question, but still, I would want to brief on this question as many people may not know about stand-up comedy. Stand-up comedy is a comic performance performed by a comedian in front of live audience. It may involve directly interacting with an audience, ask them questions (sometimes in a humorous way). It usually takes place in a Comedy club, bars, pub, nightclub, and theatres. In this act comedian generally, narrates hilarious stories about anything. The topic of a story would be related to social issues, current affairs, political hearsay, and Page 3 gossip. Witty jokes on live audience are also a part of stand-up comedy. It takes lots of courage and integrity to perform in front of numerous audiences. No, it&rsquo;s not just about telling funny stories, you must look like monkey got confused over banana. The face of yours must produce budding deeds.</p>\r\n\r\n<p>The stand-up comedy is trending among the masses.</p>\r\n\r\n<p>In 2013, All India Bakchod (AIB), a parody comedy start up group founded by Gursimran Khamba and Tanmay Bhatt approached the Yash Raj Film, one of the prestigious names in the film making industry, but instantly faced rejection from YRF. Notwithstanding getting rejected by such huge name in the industry, the four members of AIB &ldquo;Bhatt&rdquo;, &ldquo;Khamba&rdquo;, &ldquo;Aashish Shakya&rdquo;, and &ldquo;Rohan Joshi&rdquo; went on with the same concept. They touched the feet of success in no time. It was a huge hit on the internet with thousands of viewers. Even YRF was intrigued by their success and concept and came around. Next big thing they made a dart board, was politicians. They literally aimed politicians with their humorous darts by creating a two and a half minute spoof depicting on AAP leader Mr. Arvind Kejrival named Dharna Dance feat Yo Yo Kejru Singh. This video also lured over 12.45 lakh hits on You Tube. The parody victim itself praised their work by posting a brief &ldquo;nice video&rdquo; and link on his official Twitter feed. But the huge attention came in their way when they launched an event, named &ldquo;AIB Knockout&rdquo;. It was a roast comedy show that was held at the &ldquo;Sardar Vallabhbhai Patel Stadium&rdquo; in Worli Mumbai. It was held on 20th December 2014 and was uploaded on YouTube on 28th January 2015. The show was an invitation to the controversy, as it includes very filthy and abusive language and also points out an insult of popular personalities in different fields. So many celebrities weren&#39;t happy about their act. This bizarre approach of theirs towards comedy made them one of the best in the comedy industry.</p>\r\n\r\n<p>In the parallel world of AIB, TVF- The viral Fever, an online digital entertainment channel succeeded proudly on the internet, and also gained millions of viewers and fans in a very little time. Arunab Kumar, the founder of the creative network of TVF first brought this idea into the lights of a web in 2014. His motto behind this idea was to reach out to the youth, who already jaded by watching typical TV serials. This wacky idea behind creating online channel saw the success being by their side as they created multi-genre web series like TVF Pitcher, TVF Permanent Roommates, TVF Tripling, Humorously Yours etc. The stories of each web series were diverse and grew in the shed of Indian youth. This tactic turned out to be a real formula for success for them.</p>\r\n\r\n<p>This is how comedy has been and will keep raising its voice of importance. The creator of this well-versed piece of entertainment will work hard to make a huge one part of that little piece.&nbsp;&nbsp;</p>\r\n', '59b693be164f6847.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-09-11 19:16:38', '2017-10-04 11:24:49'),
(30, 16, 'Cherial – The Art Aisle ', '1', '<p>In a world full of artistic colors, art is visible at different places in<br />\r\ndiverse forms. What might halt our gaze where, we remain unaware,<br />\r\nsometimes it&rsquo;s a friend&rsquo;s house that we stare at in awe, other times<br />\r\nwe applaud creatively used artistic props in films. Basically, if you care<br />\r\nto observe, art is everywhere.</p>\r\n\r\n<p>Although films are actor-director centric, there are various other factors<br />\r\nthat shape your feature film taking it to an all new level. A film is often written<br />\r\nby a writer and is driven by the director. As visionaries, the director blends<br />\r\nhis vision with the story rewarding the audience with a gripping cocktail.<br />\r\nIn cases such as these, props play a significant role altogether. Cherial Mask<br />\r\nmaking is one of the lost but still sought after art. Masks created with<br />\r\ndifferent designs give the film an all-new persona.</p>\r\n\r\n<p>Let&rsquo;s shed some light on the Cherial Mask Making Art.</p>\r\n\r\n<p>It&rsquo;s a traditional art form which got recognition in 1976. This art was founded in a<br />\r\nsmall village named Cherial, Telangana. Every art form in Telangana has its name<br />\r\nafter the place it originated in. Cherial scroll painting is a stylized version of Nakashi<br />\r\nart. Cherial scroll painting is an art of mask making, where a few characters from the<br />\r\nscroll were converted into a mask - characters like tiger, cow, man, women, bandit<br />\r\ncould be crafted as a Cherial mask. The Cherial mask making processes are simplified<br />\r\ninto six foldings - Sculpting, Plastering, Bandaging, Smoothening, and Colouring. It is<br />\r\nthe art form which was used for storytelling. It had stories from Indian epics like<br />\r\n&ldquo;Ramayana&rdquo;, &ldquo;Mahabharata&rdquo; etc. The storytelling back then was one of the best ways<br />\r\nto live and feel the epics. In old times, grandparents used to tell these stories to their<br />\r\nchildren, and children also used to enjoy those epic stories. But as the count of movies<br />\r\nand theatres increased, storytelling became a myth. No one was interested in the<br />\r\nstorytelling anymore and that obstruction led this beautiful art in the way of demise.<br />\r\nWorshippers of this wonderful art are very difficult to find in this age. There are only 12 or 13 artists, who still believe, practice and teach the Cherial Mask art.</p>\r\n\r\n<p>Luckily, we came across a Cherial Mask Making Workshop, organized by &ldquo;Heart for Art&rdquo;, a<br />\r\npublic trust based in Pune. Their mission is to ensure a sustainable business platform for the<br />\r\nlocal artisans and to revive the many beautiful dying art forms. When we reached the venue,<br />\r\nit was totally unlike of what other art galleries would be. It held in the basement of under construction building, surrounded by the beautiful trees, it felt really fresh. There, we met a very talented Cherial artist, Mr. Dhanaloka Saikiran Verma, son of state award winners D. Nageshwar and D. Padma. He belongs to the Rangareddy district in Telangana. Highly qualified in his area, he studied Fine Arts at Venkateshwara College of fine arts, Madhavpur.<br />\r\nHe then decided to go with his family tradition legacy, i.e., Cherial Scroll Paintings and Mask Making. Now he conducts the workshop of Cherial Mask Making, which he organizes with NGOs across the country, and also teaches the same art at various schools. He also takes Cherial Painting and drawing classes to pass on his incredible wisdom to other passionate students. As he is native Telangana artist, and only knows his native language, he faced many language-related problems throughout his journey. But he never gave up and learned to speak Hindi and English languages to overcome the problems.</p>\r\n\r\n<p>It was an honour for Cast India to come across someone who&rsquo;s still carrying the art&rsquo;s legacy forward.&nbsp;</p>\r\n', '59c1fe0b9fbc8340.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-09-20 11:05:07', '2017-10-04 11:25:58'),
(31, 16, 'Kala Kollective – The True Art Collective', '1', '<p>We, as art seekers, are always in search of a place where art is worshiped beyond everything. Well, you&rsquo;re in for a treat &ndash; we found &lsquo;Kala Kollective&rsquo;! When we reached the location, we were amazed, as they had shaped their studio with a superior interior, it was simply exquisite. When you gaze at those beautiful interiors, &quot;Wow&quot; is the first word that your mouth would want to enunciate. We were there to interview the founder of &ldquo;Kala Kollective&rdquo;, there was a workshop which was about to take place, so, we decided to take a tour of the entire place.</p>\r\n\r\n<p>Have you ever thought of designing a wall with paintball? If you were to give it a thought, it would look beyond this world. That&rsquo;s what they must have imagined as they had tinted the entire wall with different colours of paintball. The entire wall obscured the vibes of being the true souvenir of art. The tower full of iced tea might not be the part of the interior, but iced tea would surely calm us, soothe our thirst while we were there. The next catchy thing that lured our attention was the Rubik&rsquo;s cube, which, were hanging on the ceiling and the lights that were incorporated in the cube, enhanced the beauty altogether. Furniture revived our feelings of comfort-ness and cozy-ness. But here, we witnessed the furniture play a different role, as all the furniture&rsquo;s assets were uplifting another definition of an interior. The cushions were engraved with various fancy texts and designs. Even the small table was designed with meaningful words and hen pictures. The shelf of books was also designed in a very beautiful way and the catalog of books must have been feeling fortunate, as it consisted of rare and hard to find books. There were two adjacent studios - on the ground floor, on the left-hand side was a studio for keyboards, and towards the right, there was a studio for drums respectively. Those rooms were like the galaxy of art, where they accommodated the sculptures of frogs with different instruments in their hands. The frogs gave a feeling of being the guardians of the galaxy. That was just the ground floor. Then, we continued our quest to the first floor, where real magic was waiting for us. As we were climbed up the steps, we saw beautiful glass walls, which were painted with hands-free drawing. That was another element of surprise for us. There were two studios upstairs for guitar, violin, and table, the interior for all the studios being different.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>Extremely talented artists - Yash Jain and Janu Bafna collaborated and came up with the idea of &ldquo;Kala Kollective&rdquo; where people can come and enjoy the art that interested them. Found in March 2017, this art podium was where they started working on the inception of ideas, and after two months they were ready to go with the executions. It&rsquo;s commendable, how they have achieved so many things in such a short span of time.</p>\r\n\r\n<p>If your mind is wishing to create a magical piece of art, then &ldquo;Kala Kollective&rdquo; is always there to guide and shape the art that is embedded in you.</p>\r\n', '59d361374bd25540.png', NULL, 'Y', NULL, NULL, 'N', '2017-10-03 15:36:47', '2017-10-04 11:26:08');
