(32, 16, 'Some unknown facts about amusement roller coaster “Hera Pheri”.', '1', '<p>Priyadarshan directed &quot;Hera Pheri&quot; which was released on 31st March 2000, really turned out to be a cult changing movie for the comedy genre. The legendary trio Akshay Kumar, Sunil Shetty and Paresh Rawal flaunted different sides and shades of humour through this epic comedy.</p>\r\n\r\n<p>Do you know, if it wasn&rsquo;t for Firoz Nadiadwala&rsquo;s lucrative perception, this chaotically hilarious movie wouldn&rsquo;t even exist? Yes, that&rsquo;s right, Nadiadwala was planning to sail somewhere else, but destiny had its own plan, where he landed on the magical island, &ldquo;Hera Pheri&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Let&rsquo;s look at some unknown facts which were responsible for the birth of Hera Pheri. &nbsp;</p>\r\n\r\n<p><strong>It was a Sanjay Dutt in a full &ldquo;Raftaar&rdquo;, but Sunil Shetty who was riding his luck.&nbsp; </strong></p>\r\n\r\n<p>Originally, Firoz Nadiadwala was about to make an action film &ldquo;Raftaar&rdquo;, for which he even signed Akshay Kumar, Sanjay Dutt, Paresh Rawal, and Tabu. However, due to some creative differences with Firoz, Sanjay Dutt walked out from the film. Then Sunil Shetty confirmed his entry in the film.</p>\r\n\r\n<p><strong>Raftaar raves out and Hera Pheri raves in</strong></p>\r\n\r\n<p>After finalizing the actors, shooting of Raftaar had started. After first scheduled, Nadiadwala realized Bollywood trend which had a very less importance of an action film, and it would be difficult for him to recover from the loss, if film wouldn&rsquo;t do well at the box office. Imagining the dark days, he wrapped up the shoot of Raftaar. But wrapping the film wasn&rsquo;t enough for him since all the actors have locked themselves in his movie. This was where &ldquo;Ramji Rao Speaking&rdquo; came to the rescue. Nadiadwala acquired a copyright of the Malayalam hit from 1989, and decided to create a remake of it with the name &ldquo;Hera Pheri&rdquo;. Rest is the history.</p>\r\n\r\n<p><strong>But trouble kept pursuing Hera Pheri and team.</strong></p>\r\n\r\n<p>After all these ups and down in the process of Hera Pheri, the team thought of having some breathing room, but unfortunately, anxiety kept shadowing them. Nadiadwala felt that the audience wouldn&#39;t be so interested in the conventional appeal of the movie. This nostalgia led him to shoot a couple of songs in Dubai. That is why &ldquo;Jab Bhi Koi Hasina&rdquo; song which was picturized on Akshay Kumar, would give you a little unorthodoxy vibe, as it was shot in Dubai.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;After movie stormed in on the box office, it was like the coolest volcano ever, as it didn&rsquo;t open well at box office initially. Thanks to some positive wordsmiths those were neighbouring the film, resulted in the success of the film.</p>\r\n\r\n<p>But, what if Nadiadwala didn&rsquo;t change his mind of shifting from Raftaar to Hera Pheri? What if Sanjay Dutt was still his first choice? It&rsquo;s hard to imagine the outcome of this scenario. But one thing is for sure, whatever happened, happened for good. Else, we would have missed this amazing amusement roller coaster of comedy.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '59fc58e55a9e6636.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-11-03 17:24:13', '2017-11-13 17:57:17'),
(33, 16, 'Secret facts about Secret Superstar', '1', '<p>Attaining the potentials to see your dreams articulate your life is something which everyone cannot attire. Such rare case scenario has portrayed by the very talented director Mr Advait Chandan in his recently successfully running movie Secret Superstar. Secret Superstar currently overwhelmingly dodging on box office. Another attention seeking element of this movie is the wacky and eccentric look of Aamir Khan. Even Zaira Wasim, who played Insia also acted like a pro. Everything has perfectly and <a name=\"_Hlk497747305\">suavely </a>met up.</p>\r\n\r\n<p>Like other movies, this movie also has the less known and unfamiliar facts. Without wasting any further time, let&#39;s reveal the secret facts about Secret Superstar.&nbsp;</p>\r\n\r\n<p><strong>1 Unconventional look of an unconventional artist.</strong></p>\r\n\r\n<p>Aamir Khan is famous for choosiness about his role and the look in the movie. This movie also wasn&rsquo;t an exception. For the role of Shakti Kumar, who is a bit quirky and weird, he developed his look by growing weird hairstyle, beard, and moustache. He even tried the beard style on every crew member including the director himself to see how that beard style would look like. It&rsquo;s the same pattern with different creative dimensions which he uses every time he does any movie. He even learned music from prestigious music composers like Anu Malik and Nadeem Saify to perfect his role of music composer in the movie.</p>\r\n\r\n<p><strong>2 The Sexy Baliye facet.</strong></p>\r\n\r\n<p>It&rsquo;s not the first time that Aamir is playing the character who is revolving around music. But this time Aamir&rsquo;s character Shakti Kumar is vibrantly wild. If you have watched his song Sexy Baliye, then you must have acknowledged his new bovine yet elegant character. But very few know that the Sexy Baliye had choreographed by Sanya Malhotra who had also worked with Aamir in Dangal. Seems like, Aamir has already started fetching multitasking from his co-actors.</p>\r\n\r\n<p><strong>3 Another perfectionist growing under the shadow of the perfectionist.</strong></p>\r\n\r\n<p>Zaira Wasim seems to be acquiring the potentials of Aamir, as she had learned how to play the guitar to justify the role of Insia. She had also studied the life of singers, how they perform on stage. It wouldn&rsquo;t be a surprise if Zaira will become the next perfectionist.</p>\r\n\r\n<p><strong>4 Even Aamir had to wait on the gate of the movie till he got the green signal.</strong></p>\r\n\r\n<p>Yes, you heard it right. The maker of the film had taken the audition of Aamir Khan to check whether he fits the role of Shakti Kumar or not. Very seldom you hear these kinds of stuff, isn&rsquo;t it?</p>\r\n\r\n<p><strong>5 The debutant Advait Chandan</strong></p>\r\n\r\n<p>It is Advait Chandan&rsquo;s debut film as a director. Before, he was a manager of Aamir Khan. if you are wondering who is the writer of this fantastically uplifting movie? Yes, you guessed it right, its non-other than the director himself.</p>\r\n\r\n<p>&nbsp;These are the disguised facts about Secret Superstar. I hope you like it.</p>\r\n', '5a01544a48129845.jpg', NULL, 'Y', NULL, NULL, 'N', '2017-11-07 12:05:54', '2017-11-13 17:57:27'),
(34, 22, 'The Beginning of the Happy Ending', '2', '<p>Dear dreamers,</p>\r\n\r\n<p>Happy ending and Happily ever after are the most common terms you must have heard of movies and fairy tales. But as we wake up to the reality we ourselves burst the bubble of our dreams admitting there is no Santa Claus or fairy godmother to swing the magic of our fantasies.</p>\r\n\r\n<p>It&#39;s sad how we stop dreaming and we even stop working towards our dreams as we grow up but whom should we blame? the society, our parents, our situations or our dreams?</p>\r\n\r\n<p>We all are born with some of the other talents but somehow the world around us convince us to make it our hobbies, not our passion and not the main motive of our life. This way we change our heart to not try any more in the only life we have.</p>\r\n\r\n<p>Giving up on yourself is not the way of life, my friends. If you try, you may win or earn an experience to write down in the book of your desires, there is no such thing as failure.</p>\r\n\r\n<p>So here we are writing for all the Writers, Poets, Actors, Directors, Photographers, Voice over Artists, Singers, Artists, Painters, Illustrators and all the desires which were converted into the secondary motive of our life. We are here to understand and listen the screams of your unfinished dreams.&nbsp; Striving an extra mile to make your talent the prime motive of your life. To break the myth that talent is just the hobby and can&rsquo;t be your Passion. A platform where you can begin the journey towards your happy ending.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>Cast India.</p>\r\n', '5a098dafbd583749.jpg', NULL, 'Y', NULL, 1, 'Y', '2017-11-13 17:48:55', '2017-11-19 20:30:01'),
(35, 22, 'The Beginning of the Happy Ending', '1,2,5', '<p>Dear dreamers,</p>\r\n\r\n<p>Happy endings and happily ever after is the climax that most people look for in movies and literature. When it comes to reality, however, happy endings are as rare as a unicorn.</p>\r\n\r\n<p>How do we cope with these failures? Who do we blame? Society? Parents? The Universe? Or our Dreams?</p>\r\n\r\n<p>Everyone is born with some talent or the other, but somehow we tend to lose that talent in order to fit in the society. Get a good education, get a decent job, get married, have kids, and life goes on. Life becomes a vicious cycle of pleasing &lsquo;the society&rsquo;. In a normal scenario, dreamers are hounded and cast out, blamed for their failure to make it &lsquo;BIG&rsquo; in the world. Who defines what &lsquo;Big&rsquo; is? Is it the society or the one who is trying to make it &lsquo;Big&rsquo;? Since when does&nbsp;satisfying others become more important than satisfying ourselves? The BIGGEST SIN, in this life, is wasted &lsquo;Talent&rsquo;. Nothing is worse than that. Imagine what would have happened if John Lennon&rsquo;s mother insisted that he has to be an engineer, not a musician, we would never have had a masterpiece like &lsquo;Imagine&rsquo;. In the lyrics, the Beatles frontman states;&nbsp;</p>\r\n\r\n<p>&ldquo;You may say I&#39;m a dreamer<br />\r\nBut I&#39;m not the only one<br />\r\nI hope someday you&#39;ll join us<br />\r\nAnd the world will be as one&rdquo;</p>\r\n\r\n<p>Taking inspiration from the beautiful lyrics of an iconic song, one should never give up on their dreams. We should understand, that there is no such thing as &lsquo;failure&rsquo;. Failure is subjective and it varies from person to person. For a beggar a decent meal is a success, where as it would be a thing of no interest for a billionaire.</p>\r\n\r\n<p>So here we are writing for all the &lsquo;Closet&rsquo; Writers, Poets, Actors, Directors, Photographers, Voice over Artists, Singers, Artists, Painters, Illustrators, etc. We are here to help you come out of that closet, to get out of the confinements imposed upon you by the society. We are here to understand and listen to the screams of your unfinished dreams.&nbsp;To ensure you find the right tools and a perfect platform to unleash your hidden talent. A platform where you can begin the journey towards your happy ending.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>Cast India.</p>\r\n', '5a11b0fd4a355636.gif', NULL, 'Y', NULL, NULL, 'N', '2017-11-19 21:57:41', '2017-11-19 21:59:35'),
(36, 22, 'An exquisite abode for all art forms', '1', '<p>There are many art forms are existing in today&rsquo;s age and there is an uncountable number of artists who are worshipping their respective art forms. Many times, they face difficulties while they look for a work podium of art. Some of them don&rsquo;t even know how to start, where to look for work and the list of difficulties goes on.</p>\r\n\r\n<p>We here at Cast India, know and feel problems of artists. Since the world of art is vast and sometimes unreachable, artists are confused over the pigmentation of art. This is the exact problem that we want to rectify,&nbsp; that&#39;s why we came up with the solution to this particular problem. Cast India is a media portal, where an experienced, aspiring, amateur or even newcomer artists are gladly welcome. You can apply for numerous work opportunities of different art forms here at Cast India, and yes, it&rsquo;s totally free of cost. There are many potential art recruiters from different art background there on our site. They are always looking for a passionate and witty artist. All they want an artist who has the hunger for art and work. If you have what it takes to become a next legendary artist, then just knock our door and consider your entry in the field of art. Whatever art form it may be, if you really possess skills to attain the beautiful palace of art, then just register yourself on,&nbsp;<strong>www.castindia.in</strong>, build a promising portfolio, and you are ready to go. If you are really thinking of yourself as the art wanderer, then you are always welcome to take a stop at our exquisite abode of all art forms and we will help you explore your future art journey.</p>\r\n\r\n<p><strong>&ldquo;Have a heart for art&rdquo;.</strong></p>\r\n', '5a1bd344dca7c401.jpeg', NULL, 'Y', NULL, NULL, 'N', '2017-11-27 14:26:36', '2017-11-28 20:54:26'),
(37, 22, NULL, NULL, NULL, NULL, NULL, 'N', NULL, NULL, 'N', '2017-11-28 19:28:55', NULL),
(38, 22, 'A one stop Platform for Creative Passion.', '1,2,3,4', '<p>Image source:&nbsp;http://www.thedailystar.net/sites/default/files/upload-2014/gallery/image/arts/creative-passion.jpg</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>How to Begin your &lsquo;Fame&rsquo; Journey</strong></p>\r\n\r\n<p>It&rsquo;s maybe in our blood, air or culture but it&rsquo;s a fact that we are known for The Art. Every day we discover some or the other hidden talents within us. It&rsquo;s not the same ancient art forms but somehow a shadow of it. The question is, what next? What to do with your discovered or already known talent? How to use it? And How to be the best in it?</p>\r\n\r\n<p>The world of Art is vague, in addition to that, the competition is also not small. You must have heard it in the famous movie, &lsquo;3 Idiots&rsquo; that &ldquo;Life is a race&hellip;if you don&rsquo;t run fast&hellip;you will be like a broken Anda&rdquo;. This is how we work towards our respective talent. We start running and struggling without knowing which is the right choice. With this concept of life, we end up giving up on our talent, or maybe we start cribbing about the tiring field.</p>\r\n\r\n<p>Well, you can derive the answer from the same movie, &ldquo;Be capable, build yourself&hellip;and success will follow you no matter what&rdquo;. Be that any form of art, Story Writing, Acting, Directing, Photography, Singing, Painting, Illustrating, etc. It needs to be polished. The art field needs a proper guidance where one can evolve day by day to be the best version of themselves.&nbsp;</p>\r\n\r\n<p>How can Cast India help?</p>\r\n\r\n<p>Cast India is a media portal, where an aspiring, amateur and experienced artists are gladly welcome. It&rsquo;s a one-stop platform to find your passion and begin your journey towards it. Not just that, Cast India prepares you for tomorrow. With cast India, you can connect with your respective interest and boost your talent by attending workshops. With the help of workshops by the well-known mentors of that field, one can upgrade their own interest. Workshops will help you and guide you a proper way towards your passion. One can work towards being capable and then definitely the success will find you there, in the same portal. Yes, we bridge the gap between enthusiasts who are seeking work and enthusiasts who are willing to give work. So that you can showcase your capability and connect to the right person without any hassle and confusion of &ldquo;Where to start?&rdquo;. Your journey to Fame Begins here.</p>\r\n\r\n<p>Register today. Register now. It&#39;s free!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>Cast India</p>\r\n', '5a26c9b6974d0241.jpg', NULL, 'N', NULL, NULL, 'N', '2017-12-05 22:00:46', NULL),
(39, 282, NULL, NULL, NULL, NULL, NULL, 'N', NULL, NULL, 'N', '2019-11-21 07:59:52', NULL);
