\r\nCast India reserves the rights to copy or use the material submitted by the participants in any form, online or offline, for the festival&rsquo;s promotional and archival purposes. Cast India Will Upload all the films submitted on the Portals You Tube Channel with its tag before the start of the film.&nbsp;<br />\r\nThe short films that are submitted and approved will not be allowed to withdraw under any circumstances.&nbsp;<br />\r\nJudges&rsquo; decision will be final and binding.<br />\r\nFestival Organizers and Cast India reserve the right to change/modify/alter rule or its part or event of this competition anytime.</p>\r\n', 'Y', 'Y', 'N', '2017-08-20 13:13:03', NULL),
