(8, 1, 11, '3,10', 'Another test created by new user', 'kolkata', '<h2>IPS FOR WRITING A GREAT EVENT DESCRIPTION</h2>\r\n\r\n<p><strong>Write a short, snappy event title</strong></p>\r\n\r\n<p>Good examples include &lsquo;Can science save humanity?&rsquo;, &lsquo;Epigenetics: you are what your grandparents ate&rsquo; or &lsquo;The mathematical magic of&nbsp;<em>The Simpson', '59b6ac2b82058381.jpg', '[\"59b6ac2b82442505.jpg\"]', 0.00, 'deccan gymakhan', '2017-09-13 00:00:00', '0000-00-00 00:00:00', 'free', '<ul>\r\n	<li>promotional poster artwork created for the event, but shrunk to a thumbnail size, with text that is visible but illegible</li>\r\n	<li>(similarly) a slide from a presentation shrunk to thumbnail size</li>\r\n	<li>an image crowded with supporter logos but little meaning or visual appeal (an exception might be NASA)</li>\r\n	<li>images for which you don&rsquo;t have usage permission or consent to use from the copyright holder and (if relevant) the people in the image. This is particularly important for images of children &ndash; see this&nbsp;<a href=\"https://aifs.gov.au/cfca/publications/images-children-and-young-people-online\" onclick=\"__gaTracker(\'send\', \'event\', \'outbound-article\', \'https://aifs.gov.au/cfca/publications/images-children-and-young-people-online\', \'Australian Institute of Family Studies fact sheet\');\">Australian Institute of Family Studies fact sheet</a>&nbsp;for more information.</li>\r\n</ul>\r\n\r\n<p><strong>Make it searchable</strong></p>\r\n\r\n<p>Remember to include the words people might use to search for your event&mdash;such as &lsquo;sport&rsquo;, &lsquo;robotics&rsquo; or &lsquo;art&rsquo;&mdash;in your description. This is particularly important if event speakers are interviewed in the media. Listeners might not remember the expert&rsquo;s name, or know how to spell it (yes, we&rsquo;re looking at you Yvette d&rsquo;Entremont and Siouxsie Wiles), so including words that are related to their subject matter will help people find the events they&rsquo;re promoting. In 2015, a search for &lsquo;SciBabe&rsquo; would yield Yvette&rsquo;s events. A search for &lsquo;Suzy Wiles&rsquo; would come back empty but you&rsquo;d find her events if you searched for &lsquo;bacteria&rsquo; or &lsquo;superbugs&rsquo;. Keep these considerations in mind.</p>\r\n', 'Y', 'Y', 'N', '2017-09-11 21:00:51', NULL),
(9, 2, 9, '9', 'Impact A 2 Min Shortfilm Festival', 'Pune', '<p>Cast India presents you with a unique opportunity to evolve, elevate and escalate your film to the next level. A 2-min film fest, IMPACT, is sure to provide your vision the platform it deserves.&nbsp;</p>\r\n', '59b77f5aa35a7408.jpg', '[\"59b77f5acd19d188.jpg\"]', 700.00, '1098/8b, Model Colony Shivaji Nagar', '2017-10-20 00:00:00', '2017-10-27 00:00:00', 'paid', '<ul>\r\n	<li>Entries for the Cast India 2 Min Film Festival are open for everyone. Participants under the legal age must submit a consent letter from their parent or guardian.</li>\r\n	<li>The Short Film can be based on any subject or concept.</li>\r\n	<li>The short film can be in any language. However, all films must include subtitles in English.</li>\r\n	<li>The total runtime of the Short Film, including opening &amp; closing credits, should strictly be a minimum of 1 minutes and a maximum of 2 minutes.</li>\r\n	<li>All content used in the short film must be either owned or licensed.&nbsp;If any copyrighted material is used in the film, the participant must have the permission and submit a copy to the Festival Organizers.</li>\r\n	<li>The Last Date for Submissions is 10th October 2017.</li>\r\n	<li>Short films must be uploaded to Google Drive and must be made available for download to the festival organizers. YouTube links are not accepted.</li>\r\n	<li>The Entry Fee is INR 700 per film. Student participants can avail a discounted entry fee of INR 500, provided they submit a copy of a valid College ID card. Payments Can be deposited once your entry is approved.</li>\r\n	<li>The Entry Should be Submitted By single person along with its cast with their registered Unique ID of Cast India. The Submission will only be accepted if all the cast from the film is provided.Multiple entries from the same participant are accepted, but each film must be accompanied by a separate form and entry fee.</li>\r\n	<li>For Every Film, a Trailer of 30 Secs has to be Submitted.</li>\r\n	<li>Cast India reserves the rights to copy or use the material submitted by the participants in any form, online or offline, for the festival&rsquo;s promotional and archival purposes. Cast India Will Upload all the films submitted on the Portals You Tube Channel with its tag before the start of the film.&nbsp;</li>\r\n	<li>The short films that are submitted and approved will not be allowed to withdraw under any circumstances.&nbsp;</li>\r\n	<li>Judges&rsquo; decision will be final and binding.</li>\r\n	<li>Festival Organizers and Cast India reserve the right to change/modify/alter rules or its part or event of this competition anytime.</li>\r\n</ul>\r\n', 'Y', 'Y', 'N', '2017-09-12 12:01:54', NULL);
