(103, 7, '3,4,6,7,14,15,18,26,30,33,34', '[\"3\",\"4\",\"6\",\"7\",\"14\",\"15\",\"18\",\"26\",\"30\",\"33\",\"34\"]', 'Required a creative person who can work with team', '<p>Capable of working with Entire team<br />\r\nInclination towards creativity<br />\r\nTake responsibility to supervise artwork, photography, and graphics developed by staff members<br />\r\nKey parameters to selection: should have excellent communications skill, &nbsp;creativity, time management skills and Most importantly Presentation Skills.&nbsp;</p>\r\n\r\n<p>Qualifications:Graduate<br />\r\nExperience:2 to 4 yrs.&nbsp;<br />\r\nContact Person:HR&nbsp;<br />\r\nRemuneration:As Per Industry Standards&nbsp;<br />\r\nHow to Apply:Email your resume at <strong>hr@adnest.in</strong> or Apply here</p>\r\n', '2017-09-30', '2017-09-30', 'Required a creative person who can work with team', 'paid', 'paid', '<p>Capable of working with Entire team<br />\r\nInclination towards creativity<br />\r\nTake responsibility to supervise artwork, photography, and graphics developed by staff members<br />\r\nKey parameters to selection: should have excellent communications skill, &nbsp;creativity, time management skills and Most importantly Presentation Skills.&nbsp;</p>\r\n\r\n<p>Qualifications:Graduate<br />\r\nExperience:2 to 4 yrs.&nbsp;<br />\r\nContact Person:HR&nbsp;<br />\r\nRemuneration:As Per Industry Standards&nbsp;<br />\r\nHow to Apply:Email your resume at <strong>hr@adnest.in</strong> or Apply here</p>\r\n', 'Pune', 'Pune', 'Y', '2017-07-29 16:43:15', NULL, 'Y', 'N', NULL),
