(115, 12, '2', '[\"2\"]', 'Hindi language fluent actors/actresses', '<p><strong><tt>Looking for <span class=\"marker\">Actors / Actressess</span> for an upcoming <span class=\"marker\">E learning project</span><br />\r\nFluency in HINDI Language is a Must.&nbsp;<br />\r\nsend your profiles to <span class=\"marker\">monsoonwindsmedia@gmail.com</span><br />\r\nplease mention in subject : <em>Profiles via castindia&nbsp;for E learning project.</em></tt></strong></p>\r\n', '2017-12-05', '2017-12-05', 'Hindi language fluent actors/actresses', 'paid', 'paid', '<p><strong><tt>Looking for <span class=\"marker\">Actors / Actressess</span> for an upcoming <span class=\"marker\">E learning project</span><br />\r\nFluency in HINDI Language is a Must.&nbsp;<br />\r\nsend your profiles to <span class=\"marker\">monsoonwindsmedia@gmail.com</span><br />\r\nplease mention in subject : <em>Profiles via castindia&nbsp;for E learning project.</em></tt></strong></p>\r\n', 'pune', 'pune', 'Y', '2017-12-01 16:34:34', NULL, 'Y', 'N', NULL),
(116, 19, '1', '[\"1\"]', 'Need Model for Shoots', '<p>Requirement:</p>\r\n\r\n<p>Modeling assignment for media library and test shoots. Artist are Required for our media library. The shoot will happen in a studio at model colony.&nbsp;</p>\r\n\r\n<p>Paid Shoots: 500/per Shift</p>\r\n\r\n<p>No. of Models Required: 10<br />\r\nCostumes: Self<br />\r\nGenre: Western, Fusion, Traditional</p>\r\n\r\n<p>Make-up: Provided</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2017-12-23', '2017-12-23', 'Need Model for Shoots', 'paid', 'paid', '<p>Requirement:</p>\r\n\r\n<p>Modeling assignment for media library and test shoots. Artist are Required for our media library. The shoot will happen in a studio at model colony.&nbsp;</p>\r\n\r\n<p>Paid Shoots: 500/per Shift</p>\r\n\r\n<p>No. of Models Required: 10<br />\r\nCostumes: Self<br />\r\nGenre: Western, Fusion, Traditional</p>\r\n\r\n<p>Make-up: Provided</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Pune', 'Pune', 'Y', '2017-12-09 12:41:18', NULL, 'Y', 'N', NULL),
(117, 19, '20', '[\"20\"]', 'Makeup Artist Required for test shoots', '<p>Need Makup artist for studio shoot. Shoot with 10 models. In total assignment of 4 days.&nbsp;</p>\r\n\r\n<p>requirement for Western/traditional/fusion</p>\r\n\r\n<p>Per shift pay out: 500/per shift</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2017-12-23', '2017-12-23', 'Makeup Artist Required for test shoots', 'paid', 'paid', '<p>Need Makup artist for studio shoot. Shoot with 10 models. In total assignment of 4 days.&nbsp;</p>\r\n\r\n<p>requirement for Western/traditional/fusion</p>\r\n\r\n<p>Per shift pay out: 500/per shift</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'modelcolonyPune', 'modelcolonyPune', 'Y', '2017-12-09 12:45:02', NULL, 'Y', 'N', NULL),
(118, 12, '2', '[\"2\"]', 'ACTORS FOR E LEARNING VIDEOS', '<p>NEED MALE / FEMALE ACTORS<br />\nFOR E LEARNING VIDEOS<br />\nHINDI LANGUAGE FLUENCY IS MUST<br />\n<br />\nsend your details to : monsoonwindsmedia@gmail.com<br />\nand call : Akshaya : 9096756912</p>\n', '2018-01-31', '2018-01-31', 'ACTORS FOR E LEARNING VIDEOS', 'paid', 'paid', '<p>NEED MALE / FEMALE ACTORS<br />\nFOR E LEARNING VIDEOS<br />\nHINDI LANGUAGE FLUENCY IS MUST<br />\n<br />\nsend your details to : monsoonwindsmedia@gmail.com<br />\nand call : Akshaya : 9096756912</p>\n', NULL, 'PUNE', 'Y', '2018-01-27 16:57:13', '2018-01-27 18:30:00', 'Y', 'N', NULL),
(119, 26, '5', '[\"5\"]', 'Shooting work for 4 months on Sony NX100', '<p>there is a 4 months project of shooting a classroom lectures. salary will be paid on monthly basis.</p>\r\n\r\n<p>Location is KOTA, Rajasthan. Food &amp; stay will be arranged by me. Candidate should have a knowledge of camera handeling and light setup.</p>\r\n\r\n<p>You can contact me on +91 9175 990 980 or write to me : vikkrant@atellier.in</p>\r\n', '2018-03-19', '2018-03-19', 'Shooting work for 4 months on Sony NX100', 'paid', 'paid', '<p>there is a 4 months project of shooting a classroom lectures. salary will be paid on monthly basis.</p>\r\n\r\n<p>Location is KOTA, Rajasthan. Food &amp; stay will be arranged by me. Candidate should have a knowledge of camera handeling and light setup.</p>\r\n\r\n<p>You can contact me on +91 9175 990 980 or write to me : vikkrant@atellier.in</p>\r\n', 'KOTA,Rajasthan', 'KOTA,Rajasthan', 'Y', '2018-03-12 00:43:12', NULL, 'Y', 'N', NULL),
(120, 26, '30', '[\"30\"]', 'Looking for Editor to edit classroom lectures shoot editing (4 months JOB)', '<p>Looking for an editor for 4 months.</p>\n\n<p>Work: Editing of Classroom lectures footage edit.</p>\n\n<p>total Duration of Job: 4 months.</p>\n\n<p>Salary will be paid on monthly basis.</p>\n\n<p>Food &amp; Stay on me.</p>\n\n<p>Get in touch with me on +91 9175 990 980</p>\n\n<p>oe mail me on: vikkrant@atellier.in</p>\n', '2018-03-19', '2018-03-19', 'Looking for Editor to edit classroom lectures shoot editing (4 months JOB)', 'paid', 'paid', '<p>Looking for an editor for 4 months.</p>\n\n<p>Work: Editing of Classroom lectures footage edit.</p>\n\n<p>total Duration of Job: 4 months.</p>\n\n<p>Salary will be paid on monthly basis.</p>\n\n<p>Food &amp; Stay on me.</p>\n\n<p>Get in touch with me on +91 9175 990 980</p>\n\n<p>oe mail me on: vikkrant@atellier.in</p>\n', 'KOTA,Rajasthan', 'KOTA,Rajasthan', 'Y', '2018-03-12 00:46:10', NULL, 'Y', 'N', NULL),
(121, 15, '1', '[\"1\"]', 'Portfolio Creation', '<p>Need female models to create a portfolio shoot for my company.&nbsp;</p>\r\n\r\n<p>Reembursment: Rs. 1250/shift</p>\r\n\r\n<p>Atleast height required: 5&#39;5&quot;</p>\r\n\r\n<p>Location of Shoot: Vishrantwadi</p>\r\n\r\n<p>Contact: 8888850922 / 9420219860</p>\r\n', '2018-07-05', '2018-07-05', 'Portfolio Creation', 'paid', 'paid', '<p>Need female models to create a portfolio shoot for my company.&nbsp;</p>\r\n\r\n<p>Reembursment: Rs. 1250/shift</p>\r\n\r\n<p>Atleast height required: 5&#39;5&quot;</p>\r\n\r\n<p>Location of Shoot: Vishrantwadi</p>\r\n\r\n<p>Contact: 8888850922 / 9420219860</p>\r\n', 'Pune', 'Pune', 'Y', '2018-06-26 10:33:03', NULL, 'Y', 'N', NULL),
(122, 15, '1', '[\"1\"]', 'Portfolio Creation', '<p>Need Male Models for portfolio creation for a company</p>\r\n\r\n<p>Paid Job: Rs. 1250/shift</p>\r\n\r\n<p>Minimum Height: 5&#39;5&quot;</p>\r\n\r\n<p>Shoot Location:Vishrantwadi</p>\r\n\r\n<p>Date of shoot: on your availability</p>\r\n\r\n<p>Contact: 8888850922 / 9820219860</p>\r\n', '2018-07-05', '2018-07-05', 'Portfolio Creation', 'paid', 'paid', '<p>Need Male Models for portfolio creation for a company</p>\r\n\r\n<p>Paid Job: Rs. 1250/shift</p>\r\n\r\n<p>Minimum Height: 5&#39;5&quot;</p>\r\n\r\n<p>Shoot Location:Vishrantwadi</p>\r\n\r\n<p>Date of shoot: on your availability</p>\r\n\r\n<p>Contact: 8888850922 / 9820219860</p>\r\n', 'Pune', 'Pune', 'Y', '2018-06-26 10:48:14', NULL, 'Y', 'N', NULL),
(123, 15, '20', '[\"20\"]', 'Makeup artist required for model portfolio shoot in and outside pune', '<p>We require a professional makeup artist for portfolio shoots scheduled in and around Pune for both male and female models.&nbsp;</p>\r\n\r\n<p>Paid Job</p>\r\n\r\n<p>Payment:400/makeup</p>\r\n\r\n<p>Assistance required from your side in styling and dressing of the models.&nbsp;</p>\r\n\r\n<p>Food and travel provided by us.&nbsp;</p>\r\n\r\n<p>Contact: 8888850922</p>\r\n', '2018-07-05', '2018-07-05', 'Makeup artist required for model portfolio shoot in and outside pune', 'paid', 'paid', '<p>We require a professional makeup artist for portfolio shoots scheduled in and around Pune for both male and female models.&nbsp;</p>\r\n\r\n<p>Paid Job</p>\r\n\r\n<p>Payment:400/makeup</p>\r\n\r\n<p>Assistance required from your side in styling and dressing of the models.&nbsp;</p>\r\n\r\n<p>Food and travel provided by us.&nbsp;</p>\r\n\r\n<p>Contact: 8888850922</p>\r\n', 'Pune', 'Pune', 'Y', '2018-06-26 10:53:37', NULL, 'Y', 'N', NULL);
