(4, 23, 'user', 'test mail sub', '<p>testeskmkl fdsmfdsm lfmsdfms &nbsp;mfsdlmfsdmfsdmflsmdflmsdf</p>\n', 1, '2017-09-05 19:08:12'),
(5, 77, 'user', 'Welcome to Cast India.', '<p>Dear Roshi,&nbsp;</p>\n\n<p>We find that you have an incomplete Profile. In case of some thing that you wanted to know from us or you have a query which you think need to be answered to help you&nbsp;in filling the details. You can email us a convenient&nbsp;time and your number we shall get in touch personally to solve your queries...</p>\n\n<p>Regards,&nbsp;</p>\n\n<p>Team Cast India</p>\n', 1, '2017-09-06 16:35:37'),
(6, 44, 'user', 'Hello Antara', '<p>Greetings for the day.</p>\n\n<p>I hope you are doing good. We just analysed your profile and found the photos uploaded by you s a banner image is not professionally created. We kindly request you to upload professional&nbsp;shoots with all profiles and different costumes so that you score better over your competition.&nbsp;</p>\n\n<p>In case you need any support please email your queries to support@castindia.in and we shall get in touch with you asap. Don&#39;t&nbsp;forget to put a convenient time slot and contact number for us to contact you.</p>\n\n<p>Regards,&nbsp;</p>\n\n<p>Team Cast India</p>\n', 1, '2017-09-06 16:41:51'),
(7, 105, 'user', 'Pending Approval for Profile', '<p>Dear Sir,&nbsp;</p>\n\n<p>The Profile submitted by you is not complete Kindly complete the Profile so as to get ur accessed&nbsp;by the recruiters.</p>\n\n<p>Your Images need to be professional. Currently, your Images are not professional&nbsp;you are not likely accepted by recruiters.</p>\n\n<p>In case of any queries please call our helpline 9890726666 between 9 AM to 3 PM from Mon- Friday.&nbsp;</p>\n\n<p>Regards,&nbsp;</p>\n\n<p>Review Team&nbsp;<br />\nCast India</p>\n', 1, '2017-11-26 10:40:23'),
(8, 107, 'user', 'Profile Pending for Approval', '<p>Dear SS,&nbsp;</p>\n\n<p>We have reviewd your profile and foud that the image used for your profile and banner&nbsp;is not appropriate.&nbsp;</p>\n\n<p>Kindly upload a proffesional image or contact us for your portfolio at a discounted price which is an exclusively available for&nbsp;Cast India Members. The Special discounted price only for you is 6,666/- + Taxes(if Applicable). This is a required criteria to get better visibility.&nbsp;</p>\n\n<p>Regards,</p>\n\n<p>Cast India Review Team&nbsp;</p>\n', 1, '2017-11-30 17:54:19');
